(8, 'AVA-00008', 'RICARDO SUXSO.', 'DIACONIA FRIF.', ' De mi consideracion :Me dirijo a usted para informarle , que luego  de haber realizado la visita  y los calculos correspondientes a la propiedad en cuestion, los resultados finales del presente avaluo son :Inmueble ubicado en la calle Victor Gutierrez nÂº 3499 , de la urbanizacion Los Andes  de la ciudad de El Alto , el mismo  tiene construcciones  de una y dos plantas  con todas sus dependencias y servicios basicos . La ubicacion del lote  es buena . El indice de comerciabilidad es bueno.', ''),
