(13, 'AVA-00013', 'Ricardo Suxo', 'GERENTE DIACONIA FRIF', 'Me dirijo a usted para informarle, que luego de haber realizado la visita y los calculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluo son : El inmueble se encuentra en la Urb. Mariscal Sucre Milluni Bajo  Sector C, Calle  Fco.  Emilio Collazo N 2775 de la ciudad de El Alto, el mismo cuenta con una vivienda de dos plantas.  Tiene todos los servicios basicos.  El indice de comerciabilidad es bueno en el sector. ', 'AVALUO INMUEBLE UBICADO EN LA URB. MARISCAL SUCRE MILLUNI BAJO SECTOR C CIUDAD  EL ALTO'),
