(23, 'AVA-00023', 'Ricardo Suxo', 'GERENTE GENERAL DIACONIA FRIF ', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los calculos correspondientes a la propiedad de referencia, los resultados e informe sobre la descripcion del inmueble son: El predio sujeto a avaluo se encuentra en la Calle Luciano Alcoreza NÂº 1688 de la zona de Villa Nuevo Potosi de la ciudad de La Paz, el mismo cuenta con construcciones antiguas de uno y dos plantas. Cuenta con todos los servicios basicos. El ingreso al inmueble es mediante calle peatonal con graderias.  ', 'AVALUO INMUEBLE UBICADO EN LA ZONA DE VILLA NUEVO POTOSI CIUDAD LA PAZ.-'),
(24, 'AVA-00024', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF', 'Me dirijo a usted para informarle que luego de haber realizado la visita y los calculos correspondientes a la propiedad de referencia, los resultados e informe sobre la descriipcion del inmueble son.  El predio sujeto a avaluo se encuentra en la Calle Jorge Salazar esq. Prolongacion Jose Liborio Nº3824 de la urb. Mercedario Sector 3 de la ciudad de El Alto. El mismo cuenta con una vivienda de interes social con todas sus dependencias y servicios y otras pequeñas ampliaciones. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. MERCEDARIO  SECTOR 3'),
(25, 'AVA-00025', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', ' Me dirijo a Usted para informarle que luego de haber realizado la visita al inmueble en cuestion se tiene los siguientes  datos: El inmueble se ubica en la urbanizacion  Tarapaca, en la Calle Miguel Angel esq. Calle Tito Yupanqui Nº 7534 ciudad de El Alto. El mismo cuenta con construcciones solidas de una planta.  Tiene servicios de luz y agua, la zona esta en proceso de asentamiento y mejoramiento en servicios basicos.  El indice de comerciabilidad es bueno por ubicarse cerca a la carretera.', 'AVALUO INMUEBLE UBICADO EN LA URB. TARAPACA CIUDAD DE EL ALTO.-'),
(26, 'AVA-00026', 'RICARDO SUXO', 'DIACONIA FRIF', ' Me dirijo a Usted para informarle que luego de haber realizado la visita al inmueble en cuestion los resultados del inmueble son: La ubicacion del inmueble esta en pleno centro de la localidad de Desaguadero, sobre la Calle Ballivian NÂº 214, el mismo cuenta con una edificacion solida de tres plantas tiene varias habitaciones y tiendas comerciales. Tiene todos los servicios basicos.  El indice de comerciabilidad es bueno.', 'AVALUO DE INMUEBLE UBICADO EN LA LOCALIDAD DE SEDAGUADERO.-'),
(27, 'AVA-00027', '', '', '', ''),
(28, 'AVA-00028', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', ' Me dirijo a Usted para informarle que luego de haber realizado la visita y los calculos correspondientes a la propiedad de referencia los resultados son : Inmueble ubicado sobre la Calle Sucre Nº 2932 de la Urbanizacion Las Nieves de la ciudad de El Alto, se encuentra con una construccion solida en obra gruesa con una losa. Cuenta con servicios de luz y agua. La zona esta en proceso de asentamiento y mejoramiento en servicios y vias. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. LAS NIEVES CIUDAD DE EL ALTO.-'),
(29, 'AVA-00029', 'RICARDO SUXO', 'DIACONIA FRIF.', 'De mi mayor consideracion: Me dirijo a usted  para informarle, que luego de haber realizado la visita y los calculos correspondientes a la propiedad de referencia, los resultados e informe sobre la descripcion del inmueble son: El predio sujeto a avaluo se encuentra en la Av. Litoral No. 6915 de la urbanizacion Mercedario sector 1, el mismo lote cuenta con construcciones de una planta .  La zona cuenta con servicios de agua y energia electrica . y esta en proceso de mejoramiento peatonal y vial. ', 'INMUEBLE UBICADO EN LA URBANIZACION  MERCEDARIO SECTOR 1 DE LA CIUDAD DE EL ALTO .'),
