(76, 'AVA-00076', 'RICARDO SUXO. ', 'DIACONIA FRIF.', '             Me dirijo a Usted para informarle , que luego  de haber realizado  la visita y los calculos correspondientes a la propiedad en referencia y la toma de fotografias los resultados e informe  sobre la descripcion  del inmueble son : El inmueble se ubica en la calle Lidia Gueiller Tejada No.2223  de la urbanizacion Rio Seco sector Libertad de la ciuadad de El Alto , el mismo cuenta con construcciones de una planta , se puede observar que la parte frontal de la edificacion se encuentra en obra gruesa .  Asi tambien vale muy bien la pena mencionar que el inmueble se encuentra ubicado en las proximidades de los terrenos de la Alcaldia de la ciudad de El Alto. El indice de comerciabilidad es bueno en el sector.', 'AVALUO UBICADO  EN LA URBANIZACION  RIO SECO  SECTOR LIBERTAD  DE LA CIUDAD DE EL ALTO.'),
