(79, 'AVA-00079', 'RICARDO SUXO', 'DIACONIA FRIF.-', 'Mediante la presente, me dirijo a Usted con el objetivo de informarle sobre la inspeccion realizada al inmueble ubicado en la urbanizacion 16 de Febrero Rio Seco de la ciudad de El Alto, el mismo se situa en la Calle Luis Espinal  NÂº 4694, tiene construcciones de economicas antiguas de una planta.  Cuenta con todos los servicios basicos. La ubicacion del lote es bueno. El indice de comerciabilidad es bueno.  NOTA.- Se recomienda que el propietario registre su Derecho Propietario.', 'INMUEBLE UBICADO EN LA URB. 16 DE FEBRERO DE LA CIUDAD DE EL ALTO.-'),
(80, 'AVA-00080', 'IDEPRO', 'OFICIAL DE NEGOCIOS.-', 'Mediante la presente, me dirijo a Usted para informarle que luego de haber realizado la inspeccion al inmuieble en cuestion, los datos y calculos son: Inmueble ubicado el la Calle Jipina esq. alle Anutani Nº 25 de la urbanizacion Cosmos 79 de la ciudad de El Alto, el mismo cuenta con construcciones economicas de una planta.  Tiene todos los servicios basicos y gas.  El indice de comerciabilidad es bueno en el sector. ', 'INMUEBLE UBICADO EN LA URB.  COSMOS 79 DE LA CIUDAD DE EL ALTO.-'),
