(151, 'AVA-00151', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted,para informarle que se realizo la inspeccion al inmueble en cuestion los resultado son de acuerdo al siguiente detalle:  Inbmueble ubicado en la Calle La Mar Nº 8225 de la urbenizacion Mutual La Primera de la ciudad de El Alto, el mismo tiene construcciones de una planta con sus dependencias y todos los servicios basicos.  La ubicacion del lote es bueno en el sector.  El indice de comerciabilidad es bueno.', 'AVALUO INMUEBLE UBICADO EN LA URBANIZACION MUTUAL LA PRIMERA DE LA CIUDAD DE EL ALTO.-'),
(152, 'AVA-00152', 'RICARDO SUXO .', 'GERENTE DIACONIA FRIF. -', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los calculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluo son: Inmueble ubicado en la Calle Kantutani No. 2025 de la Urbanizacion  Cosmos 79 U.V. D de la ciudad de El Alto. El inmueble cuenta con una construccion de dos plantas.  La zona se encuentra consolidada y tiene todos los servicios basicos y gas. El indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. COSMOS 79 U.V. D  DE LA CIUDAD DE EL ALTO .-'),
(153, 'AVA-00153', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que luego de haber realizado la inspeccion al inmueble en cuestion,  los resultados del mismo son : Inmueble ubicado en la  Calle Final Topater NÂº 2065 de la urbanizacion San Eugenio de la ciudad de El Alto, el lote esta baldio con muros perimetrales de adobe. La ubicacion del lote es cercana a la avenida Cochabamba. El indice de comerciabilidad es bueno.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION SAN EUGENIO DE  LA CIUDAD DE EL ALTO.-'),
