(156, 'AVA-00156', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se llevo a cabo la inspeccion al inmueble ubicado en la localidad de Valencia zona sur de la cuidad de La Paz, el mismo terreno baldio en pendiente pronunciada con muros perimetrales con acceso paso de servidumbre. La zona cuenta con todos los servicios basicos.  La ubicacion del lote cercano a la plaza  principal de Valencia. ', 'AVALUO DE INMUEBLE UBICADO EN LA ZONA DE VALENCIA DELA CIUDAD DE LA PAZ.-'),
(157, 'AVA-00157', 'RICARDO SUXO.', 'DIACONIA FRIF. ', 'Me dirijo A Usted para informarle , que luego de haber realizado la vista y los calculos correspondientes a la propiedad en referencia y la toma defotografias  los resultados e informe sobre la descripcion del inmueble son : El inmueble se ubica sobre la calle Portocarrero No. 1544 de la urb. Villa Alemania de la ciudad de El Alto , el mismo cuenta  con una construccion de una Parroquia de dos plantas y oficina , el mismo cuenta con todos los servicios basicos . La ubicacion es muy proxima a la avenida Bolivia . El indice de comerciabilidad es bueno .', 'AVALUO UBICADO EN LA URB. VILLA ALEMANIA DE LA CIUDAD DE EL ALTO.'),
(158, 'AVA-00158', 'RICARDO SUXO . ', 'DIACONIA FRIF.', 'Me dirijo a Usted para informarle que luego de haber  realizado la visita y los calculos correspondientes a la propiedad en referencia y la toma de fotografias , los resultados e informe sobre la descripccion del inmueble son : El predio sujeto a avaluo se encuentra en la Av. Chuquiago No. 2244 de la  urb. Atipiris  de la ciudad de El Alto , cuenta con construcciones economicas en medias aguas , no tinen buen grado de conservacion tambien se puede evidenciar el mejoramiento vial urbano,  tiene todos los servicios basicos , el indice de comerciabilidad es bueno en el sector.', 'AVALUO UBICADO EN LA URB. ATIPIRIS DE LA CIUDAD DE EL ALTO .'),
(159, 'AVA-00159', 'RICARDO SUXO .', 'DIACONIA FRIF. ', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los cálculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluó son: Inmueble ubicado en la Calle I s/n de la urbanización Cristal  de la ciudad de El Alto. El inmueble es un terreno con murales perimetrales de ladrillo , con una construccion de ladrillo en la parte posterior del predio, el inmueble no cuenta con servicios basicos . y su ubicacion es muy proxima a equipamientos de Clero , unidad Educativa y campos deportivos La zona se encuentra consolidada y tiene todos los servicios básicos y gas. El índice de comerciabilidad es bueno. ', 'AVALUO UBICADO EN LA URBANIZACION  CRISTAL I DE LA CIUDAD DE EL ALTO '),
(160, 'AVA-00160', 'RICARDO SUXO .', 'DIACONIA FRIF. ', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los cálculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluó son: Inmueble ubicado en la Calle I s/n de la urbanización  Cristal I de la ciudad de  El Alto. El inmueble es un terreno  con muros perimetrales de ladrillo  y una construccion en obra gruesa, la zona se encuentra consolidada, con todos los servicios  básicos y gas . El índice de comerciabilidad es bueno en el sector. ', 'AVALUO UBICADO EN LA URB. CRISTAL I  DEL ALA CIUDAD DE EL ALTO .'),
(161, 'AVA-00161', 'RICARDO SUXO.', 'GERENTE DIACONIA FRIF. -', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los cálculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluó son: Inmueble ubicado en la Avenida  Topater No. 2305 de la urbanización  Sajama de la  ciudad de El Alto . El inmueble cuenta con todos los servicios basicos y construcciones de una y dos plantas con sus dependencias. La zona se encuentra consolidada,  y su infrestructura vial urbana es buena . El índice de comerciabilidad es bueno. ', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION SAJAMA DE LA CIUDAD DE EL ALTO .-'),
(162, 'AVA-00162', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF. ', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los cálculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluó son: Inmueble ubicado en la urb. Copacabana, Calle Tito Yupanqui No. 2094 de la ciudad de  El Alto. El inmueble cuenta  con construcciones solidas de una y tres plantas con todas sus dependencias y todos los servicios basicos. La zona se encuentra consolidada y tiene buena infraestructura vial urbana. La ubicacion del predio es frente a un equipamiento. El índice de comerciabilidad es bueno. ', 'AVALUO UBICADO EN LA URB. COPACABANA  DE LA CIUDAD DE EL ALTO .'),
(163, 'AVA-00163', 'RICARDO SUXO.', 'GERENTE DIACONIA FRIF.-', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los calculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluo son: Inmueble ubicado en la Calle Los Andes No. 3185 de la urbanizacion El Porvenir de la ciudad de El Alto. El inmueble cuenta con una construccion economica de adobe en medias aguas. La zona se encuentra en proceso de consolidacion pasiva y tiene todos los servicios basicos. El indice de comerciabilidad es bueno en el sector. ', '  AVALUO UBICADO EN LA URBANIZACION EL PORVENIR 1 DE LA CIUDAD DE EL ALTO.-'),
(164, 'AVA-00164', 'OFICIAL DE NEGOCIOS.-', 'IDEPRO', 'Mediante la presente me dirijo a Usted, para informarle que se realizo la inspeccion al inmueble ubicado en la Urbanizacion La Merced Calle Churupampa N. 2141 de la localidad de Achocalla, el mismo cuenta con construcciones economicas. El lote es agricola, tiene crianza de cerdos y es vivienda. Cuenta con servicios de luz y agua. La zona esta sujeta a definicion de vias. La zona se encuentra al ingreso de Achocalla. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. LA MERCED JAPARI DE LA LOCALIDAD DE ACHOCALLA.- '),
(165, 'AVA-00165', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'MEDIANTE LA PRESENTE ME DIRIJO A USTED PARA INFORMARLE QUE SE REALIZO LA INSPECCION AL INMUEBLE UBICADO EN LA URBANIZACION SANTA FE, JURISDICCION DE PALCA ZONA SUR DE LA CIUDAD DE LA PAZ, EL MISMO SE UBICA SOBRE LA CALLE 1 N. 53, TIENE CONSTRUCCIONES ECONOMICAS DE UNA PLANTA EN DOS BLOQUES, CUENTA CON  SERVICIOS BASICOS Y TELEFONIA FIJA, LA ZONA ESTA EN TERRENO PENDIENTE Y  EN PROCESO DE MEJORAMIENTO VIAL.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION SANTA FE CIUDAD DE LA PAZ.-'),
(166, 'AVA-00166', 'RICARDO SUXO .', 'GERENTE DIACONIA FRIF. ', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los cálculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluó son: Inmueble ubicado en la Calle Vicente Lecoña No. 1054 de la urbanización  16 de Febrero de la ciudad de  El Alto. El inmueble cuenta con construcciones con materiales de uso comun de una y dos plantas con sus dependencias. La zona se encuentra consolidada y tiene todos los servicios básicos y gas . El índice de comerciabilidad es bueno en el sector. ', 'AVALUO UBICADO EN LA URB. 16 DE FEBRERO DE LA CIUDAD DE EL ALTO .-'),
(167, 'AVA-00167', 'RICARDO SUXO . ', 'GERENTE DIACONIA FRIF. ', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los cálculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluó son: Inmueble ubicado en la Av. Santa Vera Cruz No. 1130 , esq.calle Santa Barbara  de la urbanización German Busch Oeste  de la ciudad de El Alto. El inmueble se encuentra muy bien ubicado y tiene todos los servicios basicos, cuenta con una construccion de dos plantas con muros de adobe y ladrillo. El indice de comerciabilidad es bueno.', '  AVALUO UBICADO EN LA URB. GERMAN BUSCH OESTE DE LA CIUADAD DE EL ALTO .'),
(168, 'AVA-00168', 'RICARDO SUXO', 'GERENTE DIACONIS FRIF.-', 'Mediante la presente me dirijo a Usted, para informarle que se realizo la inspeccion al terreno, mismo que tiene las siguientes caracteristicas: Su ubicacion  esta sobre la Av. B de la urbanizacion Santa Fe de la ciudad de El Alto, el mismo terreno baldio sin muros perimetrales en esquina. La zona cuenta con servicios basicos y en proceso de asentamiento pasivo. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. SANTA FE ZONA NORTE DE LA CIUDAD DE EL ALTO.-'),
(169, 'AVA-00169', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente, me dirijo a Usted para informarle luego de haber realizado la inspeccion al predio en cuestion, los datos del mismo son: Se ubica en la Av. Enrique Finot S/N de la urb. San Martin zona sur de la ciudad de El Alto, el mismo cuenta con construcciones en obra gruesa en tres bloques con proyeccion a mas pisos. Cuenta con servicio de agua. La zona tiene todos los servicios basicos y gas. El indice de comerciabilidad es bueno.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION SAN MARTIN  DE LA CIUDAD DE EL ALTO.-'),
(170, 'AVA-00170', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para inbformarle que se realizo la inspeccion al inmueble, cuyos datos y resultados son: Inmueble ubicado en la Calle Camerun No 1102 de la urbanizacion 6 de Marzo de la ciudad de El Alto, el mismo cuenta con una vivienda solida  de una planta con todas sus dependencias y servicios. Tiene servicios de luz, agua alcantarillado en tramite. La zona en proceso de asentamiento pasivo. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION 6 DE MARZO DE LA CIUDAD DE EL ALTO.-'),
(171, 'AVA-00171', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle 19 No. 1501 de la urbanizacion Alto Pura Pura Sector I y III, la misma presenta una construccion de dos plantas con muros de adobe y ladrillo, la zona esta en la ladera Oeste de la ciudad de La Paz, tiene todos los servicios basicos. ', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION ALTO PURA PURA DE LA CIUDAD DE LA PAZ.-'),
(172, 'AVA-00172', 'RICARDO SUXO.', 'DIACONIA FRIF. ', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los calculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluo son: Inmueble ubicado en la Av. Cohoni No. 2045 esq. Calle 8 de la urbanizacion  German Busch Distrito 1-1-3 de la ciudad de El Alto. El inmueble cuenta con construcciones de una y dos plantas  de adobe y ladrillo. La zona se encuentra consolidada,el inmueble se ubica en esquina tiene todos los servicios basicos y gas. El indice de comerciabilidad es bueno en el sector. ', 'AVALUO UBICADO EN LA URB. GERMAN BUSCH DISTRITO 1-1-3 DE LA CIUDAD  DE EL ALTO .'),
(173, 'AVA-00173', 'RICARDO SUXO .', 'DIACONIA FRIF. ', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los calculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluo son: Inmueble ubicado en la Calle Francisco Emilio Collazo No. 2825 de la urbanizacion  Mariscal Sucre milluni bajo Sector C de la ciudad de El Alto. El inmueble cuenta con construcciones de una planta  con materiales de adobe y ladrillo , su ubicacion esta muy proxima a un equipamiento deportivo y una arteria principal. La zona se encuentra consolidada y tiene todos los servicios basicos y gas . El indice de comerciabilidad es bueno. ', 'AVALUO UBICADO EN LA URBANIZACION MARISCAL SUCRE MILLUNI BAJO SECTOR  C'),
(174, 'AVA-00174', 'RICARDO SUXO', 'DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted, para informarle que se realizo la inspeccion al inmueble en cuestion el mismo tiene las siguientes caracteristicas: El inmueble cuenta con una pequena habitacion nueva economica. El lote no tiene muro divisorio con el lote contiguo por tratarse de una misma duena.  Cuenta con servicios de luz y agua. La zona esta en proceso de asentamiento. El indice de comerciabilidad es bueno en sector.', 'AVALUO DE INMUEBLE  UBICADO EN LA  URBANIZACION VENTILLA I DE LA CIUDAD DE EL ALTO.-'),
(175, 'AVA-00175', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la  presente me dirijo a Usted, para informarle que se realizo la inspeccion al inmueble, datos y resultados de acuerdo al siguiente detalle: El terreno es un lote baldio, con muros perimetrales y sin muro medianero, debido a que el propietario es el mismo del lote contiguo.  Cuenta con servicios de energia electrica  y agua potable.  La zona tiene un proceso de asentamiento. El indice de comerciabilida es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. VENTILLA  I DE LA CIUDAD DE EL ALTO.-'),
(176, 'AVA-00176', 'RICARDO SUXO .', 'DIACONIA FRIF. ', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los calculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluo son: Inmueble ubicado en la Calle Mascapaque No.335 , esq. Calle Verbenas de la urbanizacion  6 de Junio de la ciudad  de  El Alto. El inmueble cuenta con construcciones de una y dos plantas. La zona se encuentra consolidada, la zona  tiene todos los servicios basicos y gas .La infrestructura vial urbana es buena , valga la pena mencionar que el inmueble se encuentra en esquina y equipamiento deportivo.  El indice de comerciabilidad es bueno. ', 'AVALUO UBICADO EN LA URBANIZACION 6 DE JUNIO DE LA CIUDAD DE EL ALTO .'),
(177, 'AVA-00177', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted, para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Omasuyos No. 4801 de la urbanizacion Bautista Saavedra UV. G de la ciudad de El Alto, el mismo cuenta con unas construcciones antiguas de una planta en dos bloques. Tiene todos los servicios basicos y gas. La zona esta consolidada. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION BAUTISTA SAAVEDRA UV. G DE LA CIUDAD DE EL ALTO.-'),
(178, 'AVA-00178', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted, para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Heroinas  de la Coronilla NÂº. 508 ladera Oeste de la ciudad de La Paz, mismo cuenta con una construccion solida de tres plantas con una pequena terraza. El lote tiene un terreno exedente segun medicion. Tiene todos los servicios basicos. El ingreso al predio mediante calle peatonal. La ubicacion es  cercana a la autopista y/o Av. Naciones Unidas.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION BARTOLINA SISA  DE LA CIUDAD DE LA PAZ.-'),
(179, 'AVA-00179', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la calle Chonchocoro de San Pedro No. 252 de la urbanizacion San Pedro Viriloco, jurisdiccion de la localidad de Viacha. Cuenta con servicios de luz y agua.  La zona se encuentra en proceso de asentamiento pasivo. ', 'AVALUO DE INMUEBLE UBICADO EN URBANIZACION SAN PEDRO JURISDICCION DE VIACHA.-'),
(180, 'AVA-00180', 'RICARDO SUXO.', 'DIACONIA FRIF. ', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la visita en el inmueble ubicado en la Calle 10 de Febrero No. 2135 de la urbanizacion 14 de Septiembre B, de la ciudad de El Alto, el mismo cuenta con una vivienda de una planta con todas sus dependencias. Tiene servicios de luz y agua. La zona se encuentra en proceso de asentamiento y mejoramiento en servicios.', 'AVALUO UBICADO EN LA URBANIZACION  14 DE SEPTIEMBRE B  DE  LA CIUDAD DE EL ALTO .-'),
(181, 'AVA-00181', 'RICARDO SUXO .', 'DIACONIA FRIF.', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los calculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluo son: Inmueble ubicado en la Calle Bartolome Andrade No. 1054 de la urbanizacion  Pedro Domingo Murillo 3ra. Seccion de la ciudad de El Alto. El inmueble cuenta con construcciones de una planta  de adobe y ladrillo. La zona se encuentra consolidada y su infrestructura  vial urbana es buena, tiene todos los servicios basicos. El indice de comerciabilidad es bueno. ', 'AVALUO UBICADO EN LA URBANIZACION PEDRO DOMINGO MURILLO 3 ra SECCION DE LA CIUDAD DE EL ALTO .'),
(182, 'AVA-00182', 'RICARDO SUXO.', 'DIACONIA FRIF. ', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los cálculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluó son: Inmueble ubicado en la Calle Chiu Chiu No.1015 de la urbanización  San Pedro de la ciudad de El Alto. El inmueble cuenta con una construccion antigiua de adobe , la ubicacion es en esquina, frente a la malla olimpica del Aeropuerto Internacional de el Alto,  La zona se encuentra consolidada y tiene todos los servicios básicos. El índice de comerciabilidad es bueno en el sector. ', 'AVALUO UBICADO EN LA URBANIZACION SAN PEDRO  DE LA CIUDAD DE EL ALTO .'),
(183, 'AVA-00183', 'RICARDO  SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle, que se realizo la inspeccion al  inmueble ubicado en la Calle Franz Tamayo No. 3545 de la urbanizacion Virgen de Copacabana de la ciudad de El Alto, el mismo cuenta con una pequena construccion economica de una planta. Tiene servicios de luz y agua potable. La zona se encuentra en proceso de asentamiento. ', 'INMUEBLE UBICADO EN LA URBANIZACION VIRGEN DE COPACABANA ZONA NORTE DE LA CIUDAD DE EL ALTO.-'),
(184, 'AVA-00184', 'RICARDO SUXO .', 'DIACONIA FRIF. ', 'Mediante la presente me dirijo a Usted, para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Melchor Perez de Holguin No. 6615 de la urbanizacion Tarapaca zona norte de la ciudad de El Alto, el mismo cuenta con una construccion solida de tres plantas en obra gruesa y otros ambientes.  Tiene servicios basicos. La ubicadcion del predio es muy cerca a la Carretera a Oruro. El indice de comerciabilidad es bueno en el sector.', '  AVALUO UBICADO EN LA URBANIZACION TARAPACA DE LA CIUDAD DE EL ALTO .'),
(185, 'AVA-00185', 'OFICIAL DE NEGOCIOS .--', 'IDEPRO.-', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la visita al inmueble ubicado en la Calle Carrasco No. 4545 de la urbanizacion Bautista Saavedra U.V. CH, de la ciudad de El Alto, el mismo cuenta con una vivienda de una planta de ladrillo y otra pequena construccion economica de adobe en obra gruesa. Tiene todos los  servicios basicos y gas ,la ubicacion del predio es muy proximo a la Av. Simon Bolivar , arteria principal que se comunica con la carretera a Laja y la Av. Juan Pablo II,  La zona se encuentra en proceso de asentamiento y mejoramiento vial urbano.', '  AVALUO UBICADO EN LA URBANIZACION  BAUTISTA SAAVEDRA U.V.  CH DE LA CIUDAD DE EL ALTO .-'),
(186, 'AVA-00186', 'DAVID FERNANDO SALAS GUISBERT', 'PROPIETARIO.-', 'Mediante la presente me dirijo a Usted, para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Kantuta No. 2018 de la urbanizacion Jardin 81 de la ciudad de El Alto, el mismo cuenta con una construccion solida de dos plantas con todas sus dependencias y todos los servicios basicos, gas y telefono. La ubicacion del lote es cercana a la Av. Bolivia .  El indice de comerciabilidad es bueno.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION VILLA JARDIN 18 DE LA CIUDAD DE EL ALTO.-'),
(187, 'AVA-00187', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Urbanizacion German Busch Oeste de la ciudad de El Alto, el mismo cuenta con construcciones economicas en tres bloques. Tiene todos los servicos basicos y gas. La ubicacion del lote es bueno.  El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. GERMAN BUSCH OESTE DE LA CIUDAD DE EL ALTO.-'),
