(194, 'AVA-00194', 'RICARDO SUXO .', '  DIACONIA FRIF. ', 'Me dirijo a usted  para informarle, que luego de haber realizado la visita y los cálculos correspondientes a la propiedad de referencia, los resultados finales del presente avaluó son: Inmueble ubicado en la Av. Ancohuma No. 2895 de la urbanización  San Pedro A de la ciudad de El Alto. El inmueble cuenta con una construccion solida de una planta, en la parte posterior construcciones precarias. Cuenta con servicios basicos. El indice dec omerciabilidad es bueno en el sector.', '  AVALUO UBICADO EN LA URB  SAN PEDRO A  DE LA CIUDAD DE EL ALTO .-'),
(195, 'AVA-00195', 'RICARDO SUXO ', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Av. Radial No.  26 de la urbanizacion San Felipe de Seque de la ciudad de El Alto, el mismo cuenta con una construccion solida en obra gruesa y un porcentaje acabado. Tiene todos los servicios basicos  y gas. La zona esta consolidada y cuenta con buene infraestructura vial urbana. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION SAN FELIPE DE SEQUE DE LA CIUDAD DE EL ALTO.-');
