(277, 'AVA-00277', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Pedro de la Gasca No. 120 de la urbanizacion San Luis Tasa de la ciudad de El Alto, el mismo cuenta con construcciones en dos bloques, uno solido en obra gruesa. Cuenta con todos los servicios basicos y gas. La zona esta consolidada considerando que es una urbanizacion antigua, tiene buena infraestructura vial urbana. El in dice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. SAN LUIS TASA DE LA CIUDAD DE EL ALTO.-'),
