(279, 'AVA-00279', 'RICARDO SUXO. ', 'DIACONIA FRIF. ', 'Mediante la presente me dirijo a Usted, para informarle que despues de realizar la visita al  predio, toma de fotografias y los calculos correspondiente  al inmueble, los resultados son : Inmueble ubicado en la calle  Luis Espinal  No. 4695 de la urbanizacion 16 de febrero  de la ciudad de El Alto, el mismo cuenta con una construccion economica de adobe de una planta. Cuenta con todos los servicios basicos y gas. La zona se encuentra  consolidada ,la infrestructura vial urbana es buena . El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. 16 DE FEBRERO DE LA CIUDAD DE EL ALTO. '),
(280, 'AVA-00280', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Paz Blanco No. 2020 de la urbanizacion Anexo Villa Cooperativa de la ciudad de El Alto, el mismo cuenta con una construccion en obra gruesa (una losa). Tiene servicios basicos. En la zona se vienen realizando trabajos de mejoramiento vial.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION ANEXO VILLA COOPERATIVA DE LA CIUDAD DE EL ALTO.- '),
(281, 'AVA-00281', '', '', '', ''),
(282, 'AVA-00282', 'RICARDO SUXO. ', 'DIACONIA FRIF. ', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Av. Periferica  No.6314  de la urbanizacion Eliodoro Camacho  de la ciudad de El Alto, el mismo cuenta con construcciones de una planta con toda sus dependencias. Cuenta con todos los servicios basicos y gas , la ubicacion es en la avenida Periferica  de 60 mts.  El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. ELIODORO CAMACHO DE LA CIUDAD DE EL ALTO . '),
(283, 'AVA-00283', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF. -', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Villacani No. 1215  de la urbanizacion 25 de julio de la ciudad de El Alto, el mismo cuenta con unas construcciones de adobe y ladrillo  de una planta con todas sus dependencias, cuenta con todos los servicios basicos y gas . El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. 25 DE JULIO DE LA CIUDAD DE EL ALTO .-'),
(284, 'AVA-00284', 'OFICIAL DE NEGOCIOS .', 'IDEPRO.', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Carretera Oruro La Paz No.7710  de la urbanizacion Division Particion Maldonado, jurisdiccion  de Achocalla, segun documentacion adjunta, el mismo cuenta con una construccion economica de ladrillo en medias aguas . Cuenta con  los servicios basicos de agua potable y energia electrica, la ubicacion del predio es en la Carretera La Paz Oruro muy proximo  al cruce Yury.  El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. DIVISION Y PARTICION MALDONADO  DE LA CIUDAD DE EL ALTO.-'),
(285, 'AVA-00285', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Bernardino Bilbao Rioja No. 3055 de la urbanizacion Tunari Fab, de la ciudad de El Alto, el mismo cuenta con construcciones de dos y tres plantas con todas sus dependencias y todos los servicios basicos y otros, el indice de comerciabilidad es bueno en el sector. ', 'INMUEBLE UBICADO EN LA URB. TUNARI FAB DE LA CIUDAD DE EL ALTO.-'),
(286, 'AVA-00286', 'RICARDO SUXO.', 'DIACONIA FRIF. ', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle 21 s/n  de la urbanizacion Mercedario Sector 4 de la ciudad de El Alto ,  el predio es un lote baldio sin muros perimetrales ni servicios basicos , se puede evidenciar la presencia de viviendas de interes social en el sector , la zona cuenta con todos los servicios basicos y no asi el inmueble  en cuestion .  El indice de comerciabilidad es bueno en el sector.', 'AVALO DE INMUEBLE UBICADO EN LA URB. MERCEDARIO SECTOR 4 DE LA CIUDAD DE EL ALTO. '),
(287, 'AVA-00287', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF. ', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Coop. Santa Ana Ltda. No.2200  de la Urbanizacion Villa Cooperativa  de la ciudad de El Alto , el mismo cuenta con una construccion economica de ladrillo en medias aguas. El predio en cuestion no cuenta con ningun servicio basico , la ubicacion del mismo es en una Av. de 18 mts.  El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. VILLA COOPERTIVA  DE LA CIUDAD DE EL ALTO. -'),
(288, 'AVA-00288', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF. -', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Simon Bolivar No. 300 de la urbanizacion Villa Simon Bolivar de la localidad de Viacha , el mismo consolidado cuenta con una construccion de ladrillo de una planta. Tiene servicios basicos de agua potable y energia electrica. La ubicacion del predio en cuestion es cercana a una avenida troncal.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. VILLA SIMON BOLIVAR DE LA LOCALIDAD DE VIACHA.-'),
(289, 'AVA-00289', 'RICARDO SUXO. ', 'DIACONIA FRIF. ', 'Mediante la presente, me dirijo a Usted para informarle que despues de realizarse  la inspeccion , toma de fotografias y los calculos correspondientes al inmueble los resultados son:  Inmueble ubicado en el Calle  25 de mayo No.1824 de la urbanizacion Villa Los Andes de la ciudad de El Alto, el mismo cuenta con construcciones solidas de una y dos plantas con buen  estado de conservacion ,  cuenta con todos los servicios basicos y gas.  La ubicacion del mismo es proximo a la avenida 16 de Julio . El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION  VILLA LOS ANDES DE LA CIUDAD DE EL ALTO. -'),
(290, 'AVA-00290', 'RICARDO SUXO. ', 'DIACONIA FRIF. ', 'Mediante la presente, me dirijo a Usted para informarle que despues de realizarse  la inspeccion , toma de fotografias y los calculos correspondientes al inmueble los resultados son:  Inmueble ubicado en la Avenida Tarapaca  No. 1223 de la urbanizacion Las Nieves  de la ciudad de El Alto, el mismo cuenta con construcciones de ladrillo y adobe en plantas bajas  ,  cuenta con los servicios basicos de agua potable y energia electrica .  La ubicacion es en avenida. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBIACDO EN LA URBANIZACION LAS NIEVES DE LA CIUDAD DE EL ALTO.-'),
(291, 'AVA-00291', 'RICARDO SUXO. ', 'DIACONIA FRIF. ', '', ' AVALUO UBICADO EN LA URBANIZACION  MONTE BELLO  DE LA CIUADA DE LA PAZ '),
(292, 'AVA-00292', 'RICARDO SUXO.', 'DIACONIA FRIF. ', 'Me dirijo a Usted  para informarle que despues de haber realizado la inspeccion , toma de fotografias y los calculos correspondientes al terreno  , los resultason son : Inmueble ubicado en la calle I s/n esquina calle II de la urbanizacion Retamas III de la localidad de Achocalla La Paz. El mismo no cuenta con muros perimetrales ni servicios basicos .La urbanizacion se encuentra en proceso de asentamiento pasivo  y la ubicacion del terreno es en esquina , el indice de comercializacion es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION RETAMAS III DE LA LOCALIDAD DE ACHOCALLA   ,  LA PAZ .');
INSERT INTO `tabla_19` (`Id`, `Codigo_Avaluo`, `Nombre`, `Empresa`, `Carta`, `Titulo`) VALUES
(293, 'AVA-00293', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble, el mismo presenta las siguientes caracteristicas o datos:  Inmueble ubicado en la Av. Las Retamas No.1921 de la urbanizacion Anexo Mercurio de la ciudad de El Alto. Cuenta con construcciones economicas de una planta con varias habitaciones en dos bloques. Tiene todos los servicios basicos y gas.  El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. ANEXO MERCURIO DE LA CIUDAD DE EL ALTO.-'),
(294, 'AVA-00294', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a su Usted para informarle que se realizo la inspeccion al inmueble ubicado en Av.  Jerusalen Nº 1375 esq. Calle 9 de la ciudad de El Alto, el mismo tiene construcciones en dos bloques, una edificacion en obra gruesa otra de una planta con todas sus dependencias y todos los servicios basicos. La ubicacion es en esquina. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION JESUS DE NAZARET DE LA CIUDAD DE EL ALTO.-'),
(295, 'AVA-00295', 'RICARDO SUXO .', 'DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de haber hecho la visita , toma de fotografias , medicion y los calculos correspondientes al inmueble los resultados son :Inmueble ubicado en la calle Basilio Catacora No. 1144 esq. calle Chuquimia de la urb. Pedro Domingo Murillo 4ta Seccion de la ciudad de El Alto , el mismo cuenta con construcciones de adobe y ladrillo en la parte  posterior  y una construccion solida de hormigon armado en obra gruesa en la parte frontal del terreno . Cuenta con toodos los servicios basicos  y gas , la ubicacion es en esquina y frente a un equipamiento educativo , el indice de comerciabilidad es bueno en el sector. ', '  AVALUO DE INMUEBLE UBICADO EN LA URB. PEDRO DOMINGO MURILLO 4ta SECCION DE LA CIUDAD DE EL ALTO.'),
(296, 'AVA-00296', 'RICARDO SUXO.', 'DIACONIA FRIF. ', 'Mediante la presente , me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Av. Brasil Esq. Av. Los Lirios S/N, de la urbanizacion 6 de Agosto de la ciudad de El Alto, segun plano adjunto jurisdiccion de Achocalla. El terreno esta baldio sin muros perimetrales. La zona se encuentra en proceso de asentamiento pasivo y mejoramiento vial urbano. El indice de comerciabilidad es bueno en el sector.', ' AVALUO DE INMUEBLE UBICADO EN LA URB. 6 DE AGOSTO DE LA CIUDAD DE EL ALTO.-'),
(297, 'AVA-00297', 'RICARDO SUXO. ', 'DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de haber realizado la inspeccion correspondiente , toma de fotografias  , medicion y calculos correspondientes al terreno  los resultados  son : Inmueble ubicado  en la calle Cosmos No. 3331 de la urbanizacion Copacabana Fonvis de la ciudad de el alto .El mismo  es un lote  con muros perimetrales de ladrillo y machones con hormigon armado , el inmueble no cuenta con servicios basicos pero se puede evidenciar  el mejoramiento vial urbano y la inmplementacion general de servicios basicos , en la zona  existe  agua potable y energia electrica , el indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE  UBICADO EN LA URBANIZACION  COPACABANA FONVIS DE LA CIUDAD DE EL ALTO .'),
(298, 'AVA-00298', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Me dirijo a Usted para informarle que despues de haber realizado la inspeccion correspondiente , toma de fotografias  , medicion y calculos del inmueble en cuestion  los resultados  son : Inmueble ubicado  en la calle F s/n  de la urbanizacion 27 de Abril de la ciudad de El Alto, el mismo cuenta con una construccion de tres plantas con hormigon armado  , su estado de conservacion es bueno , el inmueble cuenta con servicios de agua potable y energia electrica , se puede evidenciar  el mejoramiento vial urbano y la inplementacion general de servicios basicos, el indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION 27 DE ABRIL DE LA CIUDAD DE EL ALTO.-'),
(299, 'AVA-00299', 'RICARDO SUXO .', 'DIACONIA FRIF. ', 'Me dirijo a Usted, para informarle que se realizo la inspeccion  y toma de fotografias, medicion  y los calculos correspondientes  al inmueble, mismos que describo a continuacion : Terreno ubicado en la calle "S" S/N de la Urbanizacion Rio seco Sector Libertad de la ciudad de El Alto , el mismo es un lote Baldio sin muros perimetrales , no cuenta con  servicios basicos . La ubicacion del terreno frente a los predios del GAMEA. El indice de comerciabilidad es muy bueno. ', 'AVALUO UBICADO EN LA URB. RIO SECO SECTOR LIBERTAD  DE LA CIUDAD DE EL ALTO. -'),
(300, 'AVA-00300', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Manco Kapac, No. 6294 de la urbanizacion Eliodoro Camacho de la ciudad de El Alto, el mismo lote baldio con muro frontal, sin muro medianero con el lote continuo por tratarse del mismo propietario. Tiene servicios basicos. La ubicacion esta frente a un area verde. El indice de comerciabilidad es bueno.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION LOZA DE LA CIUDAD DE EL ALTO.-'),
(301, 'AVA-00301', 'RICARDO SUXO', 'GERENTE DIACONIA ', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Av. Estructurante esq. Calle Franz Tamayo de la Urbanizacion Loza Sector Challa Kota de la ciudad de El Alto, se trata de una Estacion de Servicio de GNV con una edificacion considerable. El terreno es una fusion de cuatro lotes segun planimetria de la zona. La construccion tiene dos bloques una la parte Administrativa, tiendas, depositos y otros, el otro bloque comprende las Islas, con un techo considerable en altura con columnas de HÂºAÂº. Cuenta con todos los servicios basicos y gas. La edificacion esta a estrenar. El indice de comerciabilidad es muy buena. ', 'INMUEBLE UBICADO EN LA URB. LOZA SECTOR CHALLA KOTA  DE LA CIUDAD DE EL ALTO.-'),
(302, 'AVA-00302', 'RICARDO SUXO .', 'DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes  del presente avaluo los resultados son : Inmueble ubicado en la calle Santa Ines No. 1105 de la urbanizacion Santa Isabel de la ciudad de El Alto , el mismo cuenta con construcciones de ladrillo en la parte posterior del lote  y en la parte frontal una construccion solida  con hormigon armado  en obra gruesa . Cuenta con los servicios basicos  y la infrestructura vial urbana es buena  , el indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION SANTA ISABEL DE LA CIUDAD DE EL ALTO. '),
(303, 'AVA-00303', 'RICARDO SUXO. ', 'DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes  del presente avaluo los resultados son : Inmueble ubicado en la calle Saya  No. 1154 de la urbanizacion 25 DE Julio de la ciudad de El Alto , el mismo cuenta con una construccione solida de hormigon armado en la parte frontal del mismo  . Cuenta con todos los servicios basicos  y la infrestructura vial urbana es buena en el sector  , el indice de comerciabilidad es bueno en el sector. ', 'AVALUO UBICADO EN LA URBANIZACION 25 DE JULIO DE LA CIUDAD DE EL ALTO. '),
(304, 'AVA-00304', 'RICARDO SUXO. ', 'DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes  del presente avaluo los resultados son : Inmueble ubiacdo en la calle 3  No.550 de la urbanizacion Villa bajo Tejada de la ciudad de La Paz, el mismo cuenta con construcciones economicas de una planta en medias aguas, cuenta con todos los servicios basicos y gas, la infrestructura vial urbana es buena  , Barrios de verdad , la ubicacion es en pendiente  con una acceso peatonal indice de comerciabilidad es bueno en el sector. ', 'AVALUO UBICADO EN LA URBANIZACION VILLA BAJO TEJADA DE LA CIUDAD DE LA PAZ .'),
(305, 'AVA-00305', 'RICARDO SUXO. ', 'DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de realizarse la inspeccion al inmueble ,toma de fotografias  y calculos correspondientes los resultados del presente avaluo son : Inmueble ubicado en la calle San Roman No. 2401 de la urbanizacion Bautista Saavedra U.V. G de la ciudad de El Alto , el mismo cuenta con construcciones de ladrillo en plata baja , el inmueble cuenta con los servicios basicos.el indice de comerciabilidad es bueno en el sector. ', 'AVALUO UBICADO EN LA URBANIZACION  BAUTISTA SAAVEDRA  U. V. G DE LA CIUDAD DE EL ALTO . '),
(306, 'AVA-00306', 'RICARDO SUXO .', 'DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de haber realizado la inspeccion, toma de fotografias  medicion y los calculos correspondiente  del presente avaluo los resultados son : Avaluo ubicado en la Avenida Calama S/N. esq. Calle Florida,  de la urbanizacion San Carlos de la ciudad de El Alto . El mismo cuenta con una construccion de ladrillo y columnas de HºAº  en obra gruesa. La Urbanizacion cuenta con todos los  servicios basicos  y no asi el inmueble  en cuestion . La ubicacion es en esquina  y el indice de comerciabilidada es bueno en el sector. ', 'AVALUO UBICADO EN LA URBANIZACION SAN CARLOS DE LA CIUDAD DE EL ALTO .'),
(307, 'AVA-00307', 'RICARDO SUXO. ', 'DIACONIA FRIF. ', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Max Portugal No. 1075 de la urbanizacion El Ingenio distrito 1U.V. 4 de la ciudad  de El Alto, el mismo cuenta con construcciones de dos y una planta, cuenta con los servicios basicos  y su ubicacion es buena , el indice de comerciabiliadad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. EL INGENIO DISTRITO 1 UNIDAD VECINAL. 4 DE LA CIUDAD DE  EL ALTO . '),
(308, 'AVA-00308', 'OFICIAL DE NEGOCIOS ', 'IDEPRO. ', ' Me dirijo  a Usted para informarle que despues de la inspeccion, toma de fotografias, medicion y los calculos correspondiente los resultados del presente avaluo son : Inmueble ubicado en la calle Luribay  No.2243 de la urbanizacion 14 de Septiembre sector Ventilla de  la ciudad de El Alto, el mismo cuenta con una construccion solida de hormigon armado en obra gruesa de una planta, no cuenta con servicios basicos , la propiedad  cuenta con dos frentes , hacia el equipamiento y calle. Se puede evidenciar el mejoramiento vial urbano y de y de servicios basicos, el indice de comerciabiliada es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION  14 DE SEPTIEMBRE  VENTILLA DE LA CIUDAD DE EL ALTO.-'),
(309, 'AVA-00309', 'RICARDO SUXO .', 'DIACONIA FRIF. ', 'Mediante la presente , medirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Catavi Nº 3520 de la urbanizacion Tilata de la localidad de Viacha, el mismo cuenta con  construcciones en medias aguas . Tiene servicios de energia electrica y agua potable. La zona esta en proceso de mejoramiento en servicios basicos. Elindice de comerciabilidad es bueno en el sector.', 'AVALUO UBICADO EN LA URB. TILATA DE LA LOCALIDAD DE VIACHA  LA PAZ. '),
(310, 'AVA-00310', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle 4 Nº 393-B, de la urbanizacion Rio Seco Sector Estrellas de Belen de la ciudad de El Alto, el mismo cuenta con unas construcciones solidas de una y dos plantas con todas sus dependencias y todos los servicios basicos.  El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. RIO SECO SECTOR ESTRELLAS DE BELEN DE LA CIUDAD DE EL ALTO.-'),
(311, 'AVA-00311', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se llevo a cabo la inspeccion al inmueble ubicado en la Calle Pedro Domingo Murillo Nº 2845 de la Urbanizacion Complemento Los Pinos de la ciudad de El Alto, el mismo cuenta con una construccion economica en medias aguas con notorio deterioro. Cuenta con todos los servicios basicos y gas. El indice de comerciabilidad es bueno por su ubicacion.', 'AVALUO DE INMUEBLE UBICADO EN LA  URB. COMPLEMENTO LOS PINOS DE LA CIUDAD DE EL ALTO.-'),
(312, 'AVA-00312', 'RICARDO SUXO. ', 'DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias, medicios y los calculos correspondiente del presente avaluo los resultados son : Inmueble ubicado en la avenida 5 No. 65 de la urbanizacion Nueva Santa Cruz de la ciudad de El Alto , el mismo cuenta con una construccion de ladrillo y adobe en medias aguas , cuenta con servicios de agua potable y energia electrica , La ubicacion del inmueble es en avenida  y la urbanizacion se encuentra en proceso de asentamientos y mejoramiento en servicios basicos.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION NUEVA SANTA CRUZ DE LA CIUDAD DE EL ALTO. -'),
(313, 'AVA-00313', 'RICARDO SUXO. ', 'DIACONIA FRIF. ', 'Me dirijo a Usted para para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes del presente avaluo son : Inmueble ubicado en la calle Apure No. 1114 de la urbanizacion Villa San Jose de Yunguyo , el mismo cuenta con una construccion antigua de adobe  y otra en obra gruesa , se puede evidenciar 9 machones de hormigon aramado en la la parte frontal del mismo . El inmueble cuenta con los servicios basicos y la infrestructura vial urbana es buena , la ubicacion es buena en el sector. el indice de comerciabilidad es bueno en el sector. ', 'AVALUO UBICACADO EN LA URBANIZACION VILLA SAN JOSE DE YUNGUYO  DE LA CIUDAD DE EL ALTO. '),
(314, 'AVA-00314', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Av. Ingenio No. 2944 de la urbanizacion Huayna Potosi 3Ra. Seccion de la ciudad de El Alto, el mismo cuenta con una construccion nueva de una planta con todas sus dependencias y todos los servicios basicos, gas. La ubicacion del predio es buena.  El indice de comerciabilidad es bueno.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. HUAYNA POTOSI 3RA. SECCION DE LA CIUDAD DE EL ALTO.-'),
(315, 'AVA-00315', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Jose Ignacio Sanjinez No. 1084 de la urbanizacion Pedro Domingo Murillo Sur de la ciudad de El Alto.  Cuenta con construcciones de adobe antiguas de una planta.  Tiene todos los servicios basicos y gas. El indice de comerciabilidad es muy bueno.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. PEDRO DOMINGO MURILLO SUR DE LA CIUDAD DE EL ALTO.-'),
(316, 'AVA-00316', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle azusena esq. Calle Salvia No. 3067 de la urbanizacion Nueva Tilata, jurisdiccion del municipio de Viacha. El predio en cuestion tiene una vivienda nueva con todas sus dependencias.  Cuenta con servicio de luz y energia electrica. La zona esta en proceso de crecimiento y mejoramiento en servicios basicos. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. NUEVA TILATA JURISDICCION DE VIACHA.-'),
(317, 'AVA-00317', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presento me dirijo a Ustes, para informarle que se realizo la inspeccion al inmueble ubicado en la Av. 4 y Calle 3 No. 2030 de la urbanizacion Maxima Perez zona San Roque de la ciudad de El Alto, el mismo tiene una construccion vivienda con todas sus dependencias en proceso de acabado de obra fina. El mismo tiene doble acceso (avenida y calle). Tiene servicios de luz y agua potable.  ', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION MAXIMA PEREZ DE LA CIUDAD DE EL ALTO..-'),
(318, 'AVA-00318', 'RICARDO SUXO. ', 'DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que luego de haber realizado la inspeccion , toma de fotografias ,medicion y los calculos correspondientes del presente avaluo los resultados son: Inmueble ubicado en la calle Chocaya No. 3085 de la urbanizacion Huyna Potosi 2da  Seccion de la ciudad de El Alto, el mismo cuenta con construcciones de una y dos plantas  con materiales  de uso comun, cuenta con todos los servicios basicos y gas. La ubicacion es buena por encontrarse  cerca a una avenida troncal , la infrestructura vial urbana  es buena . El indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB .HUAYNA POTOSI 2da SECCION DE LA CIUDAD DE EL ALTO. '),
(319, 'AVA-00319', 'RICARDO SUXO. ', 'DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion  y los calculos correspondientes  del presente avaluo los resultados son : Avaluo ubicado en la  avenida  9 de Abril No. 1048 de la zona Villa Nueva Potosi ,Alto Chijini de la ciudad de La Paz , el mismo cuenta con una construccion solida de 5 plantas con hormigon armado , cuenta con los servicios basicos  y su ubicacion es sobre la avenida 9 de abril . El indice de comerciabilidad  es bueno en el sector. ', '  AVALUO DE INMUEBLE UBICADO EN LA ZONA VILLA NUEVO POTOSI , ALTO CHIJINI  DE LA CIUDAD DE LA PAZ . '),
(320, 'AVA-00320', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF.-DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de realizar la inspeccion , toma de fotografias , medicion y los calculos correspondientes del presente avaluo los resultados son :Inmueble ubicado en la Calle Escoma No. 3037 de la urbanizacion German Busch 1-1-3 de la ciudad de El Alto . El mismo cuenta con una construccion de dos plantas  y se pudo evidenciar que en la planta baja  se continua trabajando la obra fina  , cuenta con todos  los servicios basicos  y la infrestructura vial urabana es buena . el indice de comercializacion es bueno en el sector. ', '  AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION  GERMAN BUSCH 1-1-3 DE LA CIUDAD  DE EL ALTO. -'),
(321, 'AVA-00321', 'RICARDO SUXO. ', 'GARENTE DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes del presente avaluo , los resultados son : Inmueble ubicado en la calle Chimburaso No. 2045 de la urbanizacion Senkata 79  de la ciudad de El Alto. El mismo cuenta con una construccion solida de Hormigon Armado  de dos plantas  en obra gruesa, se puede evidenciar construcciones antiguas en la parte posterior del predio, que no se tomaron en cuenta  por el grado de deterioro , el inmueble cuenta con los servicios basicos y gas , la ubicacion es muy proxima a un equipamiento deportivo y su indice  de comerciabilidad es bueno en el sector.', '  AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION SENKATA 79  DE LA CIUDAD DE EL ALTO. -'),
(322, 'AVA-00322', 'RICARDO SUXO.', 'DIACONIQA FRIF. ', 'Mediante la presente , me dirijo a usted para indformarle que se realizo la visita  al inmueble ubicado en la urbanizacion Ovejuyo Zona Sur de la ciudad de La Paz, el mismo cuenta con una construccion solida de dos plantas en obra gruesa , teniendo el primer piso un porcentaje de obra fina. Tiene servicios basicos . El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA ZONA  DE OVEJUYO ZONA SUR DE LA CIUDADA DE LA PAZ. '),
(323, 'AVA-00323', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF. -', 'Me dirijo a Usted para informarle que despues de la inspeccion realizada al predio en cuestion  ,los resultados son : Inmueble ubicado en la calle C No. 3 de la urbanizacion Cristal II de la ciudad de El Alto, el mismo cuenta con una construccion solida en obra gruesa  en planta baja. El inmueble cuenta con servicio de energia electrica unicamente , la ubicacion es en medio de dos equipamientos educacional y deportivo , la urbanizacion se encuentra en proceso  de asentamiento pasivo. El indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION CRISTAL II DE LA CIUDAD DE EL ALTO . -'),
(324, 'AVA-00324', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Ma. Virginia Estensoro No. 2125 de la urbanizacion Cesar Augusto de la ciudad de El Alto, el mismo cuenta con una construccion solida en obra gruesa, y otras antiguas construcciones en medias aguas. Cuenta con todos los servicios basicos y gas. La zona esta consolidada y tiene buena infraestructura vial urbana. El indice de comerciabilidad es bueno.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. CESAR AUGUSTO DE LA CIUDAD DE EL ALTO.-'),
(325, 'AVA-00325', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF. ', 'Me dirijo a Usted para informale que despues de haber realizado la inspeccion al inmueble  los resultados son : Inmueble ubicado en la calle Vicente Camargo No. 2894 Esq. Mariscal Andres de Santa cruz de  la urbanizacion America de la ciudada de El Alto .El mismo  cuenta con una construccion solida de dos plantas  con un acabado al cincuenta por ciento , cuenta  con los servicios de agua potable y energia electrica . Su ubicacion es en esquina .Valga la pena recalcar que el inmueble  corresponde a la juridiccion de  la ciudad de El Alto  y que require cambio de juridiccion  , el indice de comerciabilidad es bueno en el sector. ', '  AVALUO UBICADO EN LA URBANIZACION AMERICA DE LA CIUDAD DE EL ALTO .'),
(326, 'AVA-00326', 'RICARDO SUXO. ', 'GERENTE  DIACONIA FRIF. -', 'Me dirijo a Usted para informarle  que despues de la inspeccion realizada al inmueble los resultados son : Inmueble ubicado en la pasaje 21 No. 28 de la urb. Chasquipampa (calle 61) Ex fundo Ovejuyo de la zona sur de la ciudad de La Paz . El mismo cuenta con construcciones en medias aguas de ladrillo. El inmueble cuenta con los servicios basicos y su ubicacion es cercana a la Av. principal de Chasquipampa. El indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. EX FUNDO OVEJUYO CHASQUIPAMPA  DE LA CIUDAD DE LA PAZ .-'),
(327, 'AVA-00327', 'RICARDO SUXO', 'DIACONIA FRIF.-', 'Mediante la presente solicito a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Sucre No. 2932 de la urbanizacion La Nieves de la ciudad de El Alto, el mismo cuenta con una construccion solida de dos plantas en obra gruesa. La zona se encuentra en proceso de asentamiento acelerado y mejoramiento en servicios basicos. El indice de comerciablidad es bueno.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. LAS NIEVES DE LA CIUDAD DE EL ALTO.-'),
(328, 'AVA-00328', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF.-', 'Me dirijo a Usted para informarle que luego de haber realizado la visita y los calculos correspondientes a la propiedad en referencia , los resultados finales del presente avaluo son:Inmueble ubicado en la urb. Nuevos Horizontes III , calle Rio Desaguadero No. 92 de la ciudad de El Alto. El mismo cuenta con construcciones de una planta en buen estado de conservacion  , cuenta con todos los servicios basicos , telefono y gas.  La infraestructura vial urbana es buena , el indice de comercibilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. NUEVOS HORIZONTES III DE LA CIUDAD DE EL ALTO . -'),
(329, 'AVA-00329', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de la inspeccion al inmuble en referencia los resultados son : Inmueble ubicado en la calle Tiahuanacu No. 5230, de la  urbanizacion Villa Mercedes U.V. "C" de la ciudad de El Alto , el mismo cuenta con construcciones de adobe y ladrillo en planta baja , cuenta con los servicios basicos expto de alcantarillado publico . se puede evidenciar que el mismo predio se encuentra en la juridiccion de El Alto  y que require que se cambie de juridiccion  y empadrone el mismo en este municipio. La urbanizacion se encuentra consolidada y el indice de comerciabilidad  es bueno en el sector.', '  AVALUO DE INMUEBLE UBICADO EN LA URB. VILLA MERCEDES U.V. C DE LA CIUDAD DE EL ALTO .'),
(330, 'AVA-00330', 'OFICIAL DE NEGOCIOS.', 'IDEPRO. ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias, medicion y los calculos correspondientes del presente avaluo son: Inmueble  ubicado en la calle Boqueron No. 500 de la urbanizacion Alto Lima 3ra. Seccion de la ciudad de El Alto , el mismo cuenta con una construcion solida de dos y tres plantas en obra fina con buen material, otra construcciones de una planta en medias aguas. Cuenta con todos los servicios basicos y gas .  El indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB, ALTO LIMA 3ra SECCION DE LA CIUDAD DE EL ALTO . '),
