(332, 'AVA-00332', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle  Pichincha esq. Calle Calacoto No. 2583  de la Urb. 14 de Septiembre  de la ciudad de El Alto, el mismo cuenta con un galpon de estructura solida en obra gruesa, edificado en la superficie de tres lotes fusionados fisicamente (se recomienda fusionar los lotes para la, obtencion de un solo folio), donde funcionara una cancha reglamentaria. Esta ubicado frente a una escuela. El indice de comerciabilidad es bueno. ', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION 14 DE SEPTIEMBRE VENTILLA DE LA CIUDAD DE EL ALTO.-'),
