(350, 'AVA-00350', 'RICARDO SUXO.', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Av. Panama S/N de la urb. 6 de Marzo de la ciudad de El Alto, el mismo tiene una habitacion en obra gruesa, sus muros perimetrales solidos. Cuenta con servicio de agua potable. La ubicacion sobre una avenida principal.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. 6 DE MARZO DE LA CIUDAD DE EL ALTO.-'),
