(352, 'AVA-00352', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias ,mediciones y los calculos correspondientes los resulatados del presente avaluo son : Inmueble ubicado en la calle Cochabamba No. 524 de la Urbanizacion Alto Lima 3ra Seccion de la ciudad de El Alto , el mismo cuenta con una construccion solida de hormigon armado de dos plantas , considerando que el primer piso se encuentra en etapa de obra fina. Cuenta con los servicios basicos y gas. La infraestructura vial urbana y equipamientos son buenos .  El indice de comerciabilidad es bueno. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. ALTO LIMA 3 ra SECCION DE LA CIUDAD DE EL ALTO. -'),
(353, 'AVA-00353', 'RICARDO SUXO. ', 'GENTE DIACONIA FRIF. -', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion  al inmueble ubicado en la Av. Cuzco No.114 de la Urbanizacion Lotes y Servicios de la ciudad de El Alto, el mismo cuenta con construccion es de una planta, una vivienda de interes social que tiene una ampliacion solida en obra gruesa. Cuenta con todos los servicios basicos,gas y telefonia. La ubicacion del predio es sobre una avenida. El indice de comerciabilidad es bueno .', '  AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION RIO SECO LOTES Y SERVICIOS  DE LA CIUDAD DE EL ALTO. '),
(354, 'AVA-00354', 'RICARDO SUXO .', 'GERENTE  DIACONIA FRIF. -', 'Me dirijo a Usted, para informarle  que despues de la inspeccion , toma de fotografias ,medicion y los calculos correspondientes del presente avaluo lo resultados son : inmueble ubicado en la avenida Maria Josefa Mujia No. 1075 de la urbanizacion san Martin de Porrez de la ciuadad de El Alto, el mismo cuenta con una construccion solida de dos  plantas en un mayor porcentaje en obra gruesa y otra pequena edificacion de una planta. Cuenta con todos los servicios basicos  y gas , se puede observar el mejoramiento vial urbano. El indice de comerciabilidad es bueno en el sector.  ', 'AVALUO DE INMUEBLE  UBICADO EN LA URBANIZACION SAN MARTIN DE PORREZ DE LA CIUDAD DE EL ALTO. -'),
(355, 'AVA-00355', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle 7 S/N esq. Calle S/N de la urbanizacion Tilata  UV. A, jurisdiccion de la localidad de Viacha. El inmueble tiene una vivienda de interes social con sus dependencias. Cuenta con servicios de agua potable, alcantarillado. La ubicacion es en esquina. El indice de comerciabilidad es  bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. TILATA  UV. A JURISDICCION DE VIACHA.-'),
(356, 'AVA-00356', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF. ', 'Mediante la presente , me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes del presente avaluo los resultados son : Inmueble  ubicado en la Av. Simon Bolivar No. 1086 de  la Urb. Florida Senkata de la ciudad de El Alto , el mismo cuenta con construcciones de una planta, en la parte frontal presenta una edificacion de hormigon armado en obra gruesa. Cuenta con todos los servicios basicos y gas, la ubicacion de predio sobre una avenida  y su indice comercial es bueno en el sector.  ', 'AVALUO UBICADO EN LA URBANIZACION FLORIDA SENKATA DE LA CIUDAD DE EL ALTO. '),
(357, 'AVA-00357', 'RICARDO SUXO.-', 'GEENTE GENERAL DIACONIA FRIF. ', 'Me dirijo a Usted para informarle  que despues de la inspeccion  realizada del presente avaluo los resultados son : Inmueble ubicado en la calle Letanias No. 16 de la zona de Bella Vista de la localidad de Viacha , el mismo cuenta con una construccionen de ladrillo poratante en la parte posterior del predio con un estado de conservacion  bueno , cuenta con todos los servicios basicos y gas. Su ubicacion es en avenida y el indice de comercaibilidad es bueno en el sector. ', '  AVALUO UBICADO EN LA  ZONA BELLA VISTA DE LA LOCALIDAD DE VIACHA.'),
(358, 'AVA-00358', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF.-', 'Me dirijo a Usted para informarle que despues de la inspeccion realizada , toma de fotografias , medicion  y los calculos correspondientes  los resultados del presente avaluo son : inmueble ubicado en la avenida Radio Viloco s/n de la urb. german Busch 1-1-2 de la ciudad de El Alto , el mismo terreno esta baldio,  no cuenta con muros perimetrales  , cuenta con los servicios de agua potable y alcantarillado , su ubicacion es en avenida y su indice de comerciabilidada en el sector es bueno . ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. GERMAN BUSCH 1-1-2 DE LA CIUDAD DE EL ALTO. -'),
(359, 'AVA-00359', 'RICARDO SUXO. ', 'GERENTE  DIACONIA FRIF.-', 'Me dirijo a usted para informarle que despues de la inspeccion , toma de fotografias , medicion  y los calculos correspondientes del presente avaluo los resultados son: Inmueble ubicado en la calle Tairo No. 1044 de la urb. Anexo Huayna Potosi  de la ciudad de El Alto , el mismo cuenta con una construccion en medias aguas de ladrillo y adobe portantes ,su estado de conservacion no es bueno , cuenta con todos los servicios basicos y gas.  La ubicacion es en esquina  y el indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. ANEXO HUAYNA POTOSI  DE LA CIUDAD DE EL ALTO .- '),
(360, 'AVA-00360', 'RICARDO SUXO. ', 'GERENTE  DIACONIA FRIF.- ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes los resultados del presente avaluo son : Inmueble ubicado en la calle 6 No. 106 de la Urb. san luis Pampa de la ciudad de El Alto. El mismo cuenta con una construccion solida de hormigon armanado con todas sus dependencias, tiene un acabado al 90 por ciento , cuenta con todos los servicios basicos y gas. La infrestructura vial urbana y equipamientos es buena, el indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION SAN LUIS PAMPA DE LA CIUDAD DE EL ALTO.-'),
(361, 'AVA-00361', 'IDEPRO.', 'OFICIAL DE NEGOCIOS.- ', 'Me dirijo a Usted para informarle que despues de haber realizado la inspeccion , toma de fotografias, medicion y los calculos correspondientes los resultados del presente avaluo son : Inmueble ubicado en la Av. 9 No. 3 de la urbanizacion Alto Lima 3ra. seccion de la ciudad de El Alto, el mismo  cuenta con una construccion solida en planta baja , cuenta con los servicios basicos . Su ubicacion es en un sector de interseccion de vias amplias, el inmueble se encuentra en un sector comercial. Dar a conocer que el inmueble ha sido afectado con Sup. 46.00M2.- para ampliacion de la avenida. se evidencia  el mejoramiento vial urbano en el lugar, el indice de comercaibilidad es bueno en el sector. ', 'AVALUO UBICADO EN LA URB. ALTO LIMA 3 ra SECCION  DE LA CIUDAD DE EL ALTO. '),
(362, 'AVA-00362', 'IDEPRO', 'OFICIAL DE NEGOCIOS', 'Mediante la presente me dirijo a Usted, para informarle que se realizo la inspeccion al inmueble ubicado en la zona de Chijini Alto, Callejon  Bustamante No. 11 ciudad de La Paz, el mismo tiene una construccion solida de cuatro plantas con tres departamentos. El inmueble tiene dos ingresos ambos callejones peatonales. Cuenta con todos los servicios basicos y gas. La zona tiene una topografia pendiente. ', 'AVALUO DE INMUEBLE UBICADO EN LA ZONA DE CHIJINI ALTO DE LA CIUADA DE LA PAZ .-'),
(363, 'AVA-00363', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF.- ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes del presente avaluo los resultados son: Inmueble ubicado en la calle Illimani No. 1585 de  la urb. El Ingenio dist. 2 unidad 2 de la ciudad de El Alto , el mismo cuenta con una construccion solida de dos plantas  con un acabado al 80 por ciento en obra fina . La infreestructura vial urbana se encuentra en proceso de mejoramiento , cuenta con todos los servicios basicos y gas. el indice de comerciabilidada es bueno en el sector. ', 'AVALUO UBICADO EN LA URB. EL INGENIO DE LA CIUDADA DE EL ALTO. '),
(364, 'AVA-00364', 'RICARDO SUXO. ', 'GERENTE  DIACONIA FRIF. -', 'Me dirijo a Usted para informarle que despues de la inspeccion realizada , toma de fotografias , medicion y los calculos correspondientes los resultados del presente avaluo son : Inmueble ubicado en la calle Geronimo Fernandez De Cabrera No. 2095 de la urb. Villa Adela Alemania  de la ciudad de El Alto , el mismo cuenta con construcciones en planta baja con todas sus dependencias, su estado de conservacion es buena. Cuenta con los servicios basicos , gas y telefono . La infrestructura vial urbana es buena , el indice de comerciabilidad es  bueno en el sector. ', 'AVALUO  DE INMUEBLE UBICADO EN LA URB. VILLA ADELA ALEMANIA DE LA CIUDAD DE EL ALTO. -'),
(365, 'AVA-00365', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF.- ', 'Me dirijo  Usted para informarle que despues de la inspeccion realizada  se tomo fotografias ,mediciones  y los calculos correspondientes del presente avaluo son : Inmueble ubicado en la av.Franco Valle  No. 6601 de la Urb.12 de Octubre de la ciudad de El Alto , el mismo cuenta con una construccion de 4 plantas con una acabado al 70 por ciento en obra fina, la ubicacion del predio es en area comercial, cuenta con todos los servicios basicos. El indice de comerciabilidad es bueno.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. 12 DE OCTUBRE DE LA CIUDAD DE EL ALTO. -'),
(366, 'AVA-00366', 'IDEPRO', 'OFICIAL DE NEGOCIOS.-', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en el edificio Sky Tower, de la Av. Sanchez Lima de la zona de Sopocachi, piso 11 Departamento 11A, cuenta con tres dormitorios  area social cocina, comedor, cuatro banos y otras dependencias, El material de construccion es de primera. Tiene todos los servicios basicos. Su ubicacion es muy cercano a la Plaza  Avaroa. El indice de comerciabilidad es muy bueno.', 'AVALUO DE INMUEBLE UBICADO EN LA ZONA DE SOPOCACHI  DE LA CIUDAD DE LA PAZ.-'),
(367, 'AVA-00367', '', '', '', ''),
(368, 'AVA-00368', 'RICARDO SUXO ', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Don Bosco No. 5300 de la Urbanizacion Mariscal Santa Cruz, jurisdiccion de la localidad de Viacha, el mismo cuenta con una construccion solida de dos plantas en obra gruesa. Cuenta con servicios de Luz y energia electrica. La zona esta en proceso de asentamiento pasivo y mejoramiento en servicios basicos.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. MARISCAL SANTA CRUZ , JURISDICCION DE VIACHA.-'),
(369, 'AVA-00369', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF.-', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes del presente avaluo son : Inmueble ubicado en la  calle Cristal No. 3804 de la urb. German Busch 1-1-2 de la ciudad de El Alto , el mismo cuenta con con una construccion solida de dos plantas de  hormigon armado en la parte frontal del predio en obra gruesa y en la parte posterior una construccion antigua de adobe en mal estado de conservacion, el inmueble cuenta con todos los servicios basicos y gas . La ubicacion es proxima una avenida  principal. el indice de comerciabilidad es bueno en el sector.  ', 'AVALUO UBICADO EN LA URB. GERMAN BUSCH 1-1-2 DE LA CIUDAD DE EL ALTO.- '),
(370, 'AVA-00370', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF. -', 'Me dirijo  Usted para informarle que despues de la inspeccion realizada , la toma de fotografias, mediciones y los calculos correspondientes del presente avaluo los resultados son : Inmueble ubicado en la calle Karkapongo de la Urb. Juana Azurduy de Padilla U.V. G de la ciudad de El Alto , el mismo cuenta con una construccion solida de Ho.Ao. en tres plantas con todas sus dependencias, se puede evidenciar que la obra fina se encuentra concluida en un 80% de la ultima planta. Cuenta con todos los servicios basicos y gas. Su ubicacion es entre dos calles , el indice de comercaibilidad es bueno en el sector. ', 'AVALUO UBICADO EN LA URBANIZACION  JUANA AZURDUY DE PADILLA U.V.  G   DE LA CIUDAD DE EL ALTO. -'),
(371, 'AVA-00371', '', '', '', ''),
