(373, 'AVA-00373', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF. -', 'Me dirijo a usted para informarle que despues dela inspeccion , toma de fotografias, medicion y los calculos correspondientes del presente avaluo son : Inmueble ubicado en la calle Tiquina No.8055 de la urb. Villa Mercedes U.V.C de la ciudad de El Alto , el mismo es un lote baldio con muro perimetral frontal de adobe. No cuenta con servicios basicos. La zona se encuentra consolidada y tiene todos los servicios basicos y gas.  El indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. VILLA MERCEDES U.V. C DE LA CIUDAD DE EL ALTO. -');
INSERT INTO `tabla_19` (`Id`, `Codigo_Avaluo`, `Nombre`, `Empresa`, `Carta`, `Titulo`) VALUES
(374, 'AVA-00374', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle 21 S/N de la urbanizacion Mercedario Sector 7 de la ciudad de El Alto, el mismo tiene una construccion tipo estandart de una planta en obra gruesa terminada.La zona tiene servicios de luz y agua potable. La ubicacion del predio es en esquina. La zona se encuentra en proceso de asentamiento pasivo.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. MERCEDARIO SECTOR 7 DE LA CIUDAD DE EL ALTO.-'),
(375, 'AVA-00375', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF.- ', 'Mediante la la presente , me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle  Luis Heredia S/N de la urb. 3 de Mayo de la ciudad de El Alto , el mismo lote baldio con muro frontal de adobe , no cuenta con servicios basicos, sin embargo la zona cuenta con todos los servicios basicos y gas . La ubicacion  es muy proxima a la av. Cochabamba . El indice de comercializacion es bueno en el sector.', '  AVALUO DE INMUBLE UBICADO EN LA URB. 3 DE MAYO DE LA CIUDAD DE EL ALTO. '),
(376, 'AVA-00376', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle J No. 610 de la Urbanizacion Chijimarca de la ciudad de El Alto, el mismo cuenta con una vivienda con todos sus dependencias y todos los servicios. El factor de conservacion es bueno. El indice de comerciabilidad es bueno. ', 'AVALUO DE INMUEBLE UBICADO EN LA  URB. CHIJIMARCA DE LA CIUDAD DE EL ALTO.-'),
(377, 'AVA-00377', 'RICARDO SUXO.', 'GERENTE GENERAL DIACONIA FRIF.-', 'Me dirijo a usted para informarle que despues de la inspeccion , toma de fotografias y los calculos correspondientes del presente avaluo los resultados  son : Inmueble ubicado en la Av. Roca S/N de la Urb. Tarapaca  de la ciudad de El Alto. El mismo tiene una construccion de adobe de una planta, cuenta con servicios basicos, la ubicacion es en esquina y el indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. TARAPACA  DE LA CIUDAD DE EL ALTO. -'),
(378, 'AVA-00378', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF. ', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Gorrion No. 50 de la Urbanizacion Ex Fundo Ovejuyo de la ciudad de La Paz, jurisdiccion  de Palca. El mismo cuenta con una construccion solida de tres plantas en obra gruesa, teniendo una sola habitacion terminda. Cuenta con servicios basicos. Su ubicacion es cercana a la Avenida Principal de la zona. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO  EN LA ZONA DE OVEJUYO DE LA CIUDAD DE LA PAZ , JURISDICCION DE PALCA.-'),
(379, 'AVA-00379', 'RICARDO SUXO.', 'GERENTE   DIACONIA FRIF. -', 'Me dirijo a Usted para informarle que despues de haber realizado la inspeccion , toma de fotografias  medicion y los calculos correspondientes los resultados del presente avaluo son:Inmueble ubicado en la Av.  Santa Cruz No. 6250 de la urb. Villa Mercedes U.V. C de la ciudad de El Alto, el mismo cuenta con una construccion nueva con todas sus dependencias  y otra construccion en obra gruesa en la parte frontal del  lote , tiene todos los servicios basicos y gas , su ubicacion es en avenida  y su indice de comerciabilidad es bueno en el sector. ', 'AVALUO UBICADO EN LA URBANIZACION VILLA MERCEDES U.V. C DE LA CIUDAD DE EL ALTO. -'),
(380, 'AVA-00380', 'RICARDO SUXO . ', 'GERENTE DIACONIA FRIF. -', ' Me dirijo a usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes del presente avaluo los resultados son : Inmueble ubicado en la Calle 7 No 6 de la urb. Villa Paulina  de la ciudad de El Alto. El mismo cuenta con una construccion de ladrillo en planta baja. Tiene  servicios de agua potable y energia electrica, su ubicacion es  frente a un equipamiento deportivo. El indice de comerciabiliadad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION  VILLA PAULINA DE LA CIUDAD DE EL ALTO . -'),
(381, 'AVA-00381', 'RICARDO SUXO', 'DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Urb. San felipe de Seque Sector I, Av. Radial No. 9075 ciudad de El Alto. El mismo cuenta con una construccion  recientemente terminada y comienzo de revestimiento en areas humedas, tiene todos los servicios basicos y gas.  La Av. Radial, esta en proceso de mejoramiento. El indice de comerciabilidad es bueno. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. SAN FELIPE DE SEQUE SECTOR I DE  LA CIUDAD DE EL ALTO.-'),
(382, 'AVA-00382', 'RICARDO SUXO', 'DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion  al inmueble ubicado en la Calle Ma.  Manuela Campos No. 1059 de la Urb. El ingenio Dist. 1 U.V. 2 de la ciudad de El Alto, el mismo cuenta con una construccion nueva de una planta con todas sus dependencias y servicios. Otra construccion antigua de dos plantas. Tiene todos los servicios basicos y gas. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URBANIZACION EL INGENIO DIST. 1 UV. 2 DE LA CIUDAD DE EL ALTO.-'),
(383, 'AVA-00383', 'RICARDO SUXO . ', 'GERENTE  DIACONIA FRIF. -', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes del presente avaluo los resultados son los siguientes: Inmueble ubicado en la calle San Jorge No. 1054 de la urb. Villa Concepccion  de la ciudad de El Alto, el mismo cuenta con construcciones de antiguas de adobe, de una planta, cuenta con todos los servicios basicos y gas. La infrestructura vial urbana es buena. El indice de comerciabilidad es bueno en el sector. ', '  AVALUO DE INMUEBLE UBICADO EN LA URB. VILLA CONCEPCION DE LA CIUDAD DE EL ALTO. -'),
(384, 'AVA-00384', 'RICARDO SUXO . ', 'GERENTE  DIACONIA FRIF. -', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Av. Cusco No.2184 de la Urbanizacion Rio Seco Sector San Jose de Yunguyo de la ciudad de El Alto, el mismo cuenta con una construcciones de una y dos plantas de adobe, tiene todas sus dependencias y todos los servicios basicos y gas. La zona esta totalmente consolidada y cuenta con toda infraestructura vial urbana en buen estado.  El indice de comerciabilidad es bueno. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. RIOS SECO , SAN JOSE DE YUNGUYO DE LA CIUDAD DE EL ALTO.-'),
(385, 'AVA-00385', 'RICARDO SUXO .', 'GERENTE GENERAL DIACONUIA FRIF. -', 'Mediante la presente me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes del presente avaluo , los resultados son : Inmueble ubicado en la Av. Cocahabamba No. 1434 de la Urb. Loza Sector Challa Kota  de la ciudad de El Alto, el mismo cuenta con construcciones solidas  de ladrillo en hormigon armado en planta baja , se puede evidenciar estructura  solida para futuras plantas , cuenta con todos los servicios basicos y gas. La ubicacion de la propiedad es en esquina , el indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. LOZA SECTOR. CAHLLA KOTA DE LA CIUDADA DE EL ALTO . '),
(386, 'AVA-00386', 'RICARDO SUXO.', 'GERENTE  DIACONIA FRIF. -', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Isidoro Belzu No. 7750 de la urb. Fabril Juntu Huma Sector 1 y 2 de la ciudad de El Alto, el mismo cuenta con construcciones de una planta de adobe y ladrillo con una proyeccion de machones de Ho. Ao. Cuenta con todos los servicios basicos. El indice de comerciabilidad es bueno en el sector. ', 'AVALUO UBICADO EN LA URB.  FABRIL JUNTU HUMA SECTOR I Y II DE LA CIUDAD DE EL ALTO . '),
(387, 'AVA-00387', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF. -', 'Me dirijo a usted para informarle que despues  de la inspeccion  , toma de fotografias , medicion  los resultados del presente avaluo son : Inmueble ubicado en la Calle Velasco No.2604 esq. Av. Santa Fe de la Urb. 16 de Febrero de la ciudad de El Alto. el mismo es un lote de terreno con muros perimetrales de ladrillo y adobe . Cuenta con el servicios de agua potable unicamente, la zona cuenta con todos los servicios  basicos y gas. La infrestructura vial urbana en el sector es buena , la ubicacion es en esquina y sobre una avenida principal, el indice de comerciabilidad es bueno.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. 16 DE FEBRERO DE LA CIUDAD DE EL ALTO .-'),
