(432, 'AVA-00432', 'RICARDO SUXO. ', 'GERENTE  GENERAL DIACONIA FRIF. ', 'Me dirijo a Usted para informarle , que despues de haber  realizado la visita y los calculos correspondientes a la propiedad en referencia, los resultados son : Inmueble ubicado en la Calle Mariscal Andres de Santa Cruz No. 2060 esquina Calle Tupac Katari de la Urb. America ciudad de El Alto, el mismo cuenta con una construccion solida de tres plantas, departamentos y tiendas. La zona esta en proceso de mejoramiento urbano vial y servicios basicos. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. AMERICA DE LA CIUDAD DE EL ALTO . '),
(433, 'AVA-00433', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para  informarle que se realizo la inspeccion al inmueble ubicado en la Av. Copa No. 708 de la Urb. Mariscal Santa Cruz, jurisdiccion de la localidad de Viacha, el mismo cuenta con construcciones economicas de una planta en dos bloques. Tiene servicios de luz y agua potable. La zona se encuentra en proceso de asentamiento pasivo y mejoramiento en servicios basicos.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. MARISCAL SANTA CRUZ JURISDICCION DE VIACHA.-'),
