(449, 'AVA-00449', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de la inspeccion ,toma de fotografias , medicion y los calculos correspondientes del presente avaluo , los resultados son: Inmueble ubicado en la Calle 29 No. 40 de la Urb.Chijini Alto de la ciudad de El Alto , el mismo cuenta con construcciones de una planta en la parte posterior del terreno y en la parte frontal una construccion solida de hormigon armado en obra gruesa con un acabado al 50 por ciento en planta baja , cuenta con los servicios basicos de agua potable y energia electrica solamente , se puede evidenciar el mejoramiento vial urbano  y de servicios en el lugar , el indice de comercializacion es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. CHIJINI ALTO DE LA CIUDAD DE EL ALTO. '),
