(453, 'AVA-00453', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA RIF. ', 'Me dirijo a Usted para informarle que despues de la inspeccion y calculos correspondientes  los resutados son : Inmueble ubicado en la Calle Sorata No. 3195 de la Urb. Nueva Esperanza de la ciudad de El Alto. El mismo cuenta con construcciones de ladrillo y adobe portantes de una planta, se observa que parte de la edificacion se encuentra en obra gruesa. Tiene servicios basicos y gas, la ubicacion del predio es cercana a una interseccion de avenidas. Se evidencia el mejoramiento de vias y equipamiento en el lugar. El indice de comerciabilidad es bueno en el sector. ', 'AVALUO UBICADO EN LA URB. NUEVA ESPERANZA DE LA CIUDAD DE EL ALTO.'),
