(455, 'AVA-00455', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente, me dirijo a Usted para informarle que se llevo a cabo la inspeccion al inmueble ubicado en la zona de Villa Salome de la ciudad de L a Paz, el mismo cuenta con construcciones de una planta en tres bloques con todas sus dependencias y servicios basicos. La zona se encuentra en proceso de mejoramiento en vias e infraestructura urbana. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA ZONA DE VILLA SALOME DE LA CIUDAD DE LA PAZ.--'),
