(460, 'AVA-00460', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF. -', ' Me dirijo a Usted para informarle  que despues de la inspeccion , toma de fotografias ,medicion y los calculos correspondientes del presente avaluo son : Inmueble ubicado en la Calle Hilata No. 2095 de la Urb. Rio Seco Sector Anexo 25 de Julio de la ciudad de El Alto. El mismo cuenta con construcciones de una y dos plantas con materiales de uso comun , su estado de conservacion es regular, cuenta con todos los servicios basicos y gas . La infrestructura vial urbano de la zona estan proceso de mejoramiento. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. RIO SECO SECTOR ANEXO 25 DE JULIO DE LA CIUDAD DE EL ALTO .-'),
(461, 'AVA-00461', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF. -', 'Me dirijo a Usted para informarle que despues de la inspeccion y toma de fotografias , medicion y los calculos correspondientes  , los resultados del presente avaluo son :Inmuble ubicado en la Av. Nacional de Bolivia No. 5215 de la Urb. San Felipe de Seque Sector 7 de la ciudad de El Alto , El mismo cuenta con una construccion  economica de adobe portante  en obra gruesa , cuenta con los servicios basicos de agua potable y energia electria  , su ubicacion es en avenida de 30 mts. El indice de comerciablidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. SAN FELIPE DE SEQUE SECTOR 7 DE LA CIUDAD DE EL ALTO. -'),
