(469, 'AVA-00469', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Nicanor Torrez No. 1994 de la urbanizacion Villa Esther de la ciudad de El Alto, el mismo cuenta con una construccion antigua de dos y una planta. Tiene todos los servicios basicos y gas domiciliario. El indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. VILLA ESTHER DE LA CIUDAD DE EL ALTO.-'),
(470, 'AVA-00470', 'RICARDO SUXO.', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted, para informarle que se realizo la inspeccion al inmueble ubicado en la Av. Julio Cesar Valdez No. 5234 de la Urb. Cosmos 79 UV. F de la ciudad de El Alto, el mismo cuenta con unas construcciones antiguas de dos plantas con un estado de conservacion no muy bueno.  Tiene todos los servicios basicos y gas. La ubicacion del predio en cuestion es sobre una avenida troncal. El indice de comerciabilidad es bueno.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. COSMOS 79 UV F. DE LA CIUDAD DE EL ALTO.-'),
(471, 'AVA-00471', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion  y los calculos correspondientes del presente avaluo son : Inmueble ubicado en la Calle Gregorio Pacheco No. 1095 de la Urb. 16 de Febrero de la ciudad de El Alto . El mismo cuenta con construcciones solidas  de una y dos plantas con hormigon armado se puede evidenciar que el terminado de sus construcciones son al 90 por ciento , cuenta con todos los servicios basicos y gas.El indice de coemrciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. 16 DE FEBRERO DE LA CIUDAD DE EL ALTO. '),
(472, 'AVA-00472', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF.-', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias ,medicion y los calculos correspondientes , los resultados del presente Avaluo son : Inmueble ubicado en calle S/N  de la Urbanizacion Monje Campero II de la juridiccion de Laja. El mismo no cuenta con muros perimetrales ni servicios basicos , su ubicacion es frente a equipamiento , se puede evidenciar el asentamiento pasivo en el lugar  su ubicacion es muy proxima a la carretera Panamericana . El indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. MONJE CAMPERO II  LOCALIDAD DE LAJA.-'),
(473, 'AVA-00473', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Jose Enrique Rodo esq. Calle Cabo Felix No. 567 de la zona de Vino Tinto de la ciudad de La Paz, el mismo tiene una construccion solida de dos y una plantas, edificados en terreno terraceado cuenta con tres departamentos con todas sus dependencias y todos los servicios basicos.  El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA ZONA DE VINO TINTO DE LA CIUDAD DE LA PAZ.-'),
(474, 'AVA-00474', 'RICARDO SUXO.', 'GERENTE  DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted, para informarle que se realizo la visita al inmueble ubicado en la Calle Samuel Vargas No. 67 de la Urb. Condorini (Villa La Merced) zona norte de la ciudad de La Paz, el mismo cuenta con una construccion solida en dos bloques de dos plantas con todas sus dependencias y todos los servicios basicos. El predio en cuestion esta sobre un terreno pendiente. La ubicacion es cercana a la Av. Periferica. El indice de comerciabilidad es bueno.', 'AVALUO DE  INMUEBLE UBICADO EN LA  ZONA DE  CONDORINI  ZONA NORTE DE LA CIUDAD DE LA PAZ.-'),
(475, 'AVA-00475', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle 14 No. 67 de la Urb. Coqueni zona sur de la ciudad de La Paz, la zona es colindante con Chasquipampa ingreso por la calle 46, el mismo cuenta con una pequena vivienda, con sus dependencias. El terreno tiene una pendiente pronunciada. Tiene todos los servicios basicos. La zona esta en proceso de asentamiento. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. COQUENI  ZONA SUR DE LA CIUDAD DE LA PAZ.-'),
(476, 'AVA-00476', 'RICARDO SUXO.', 'GERENTE GENERAL DIACONIA FRIF.- ', 'Mediante la presente me dirijo a Usted, para informarle que se realizo la inspeccion al inmueble ubicado en el area industrial de la localidad de Viacha, muy cerca a la Fabrica Soboce y otras fabricas de ladrillo, el ingreso al terreno es mediante sendero, sin embargo segun georeferenciado se tiene la calle Elias Perez  de 10.00ml .  El terreno esta baldio sin muros perimetrales (terreno en bruto). La zona cuenta con servicios de luz, gas y agua mediante bombeo de pozos. El indice de comerciabilidad es bueno considerando el uso de suelo determinado. ', 'AVALUO DE INMUEBLE UBICADO EN LA ZONA  HUANCAMAYU JANCO JANCO CUCHO  AREA INDUSTRIAL VIACHA.-'),
(477, 'AVA-00477', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF.-', 'Mediante  la presente me dirijo a Usted para informarle que despues de haber realizado la inspeccion , toma de fotografias , medicion , y los calculos correspondientes del presente avaluo los resultados son : Inmueble ubicado en la Avenida 1 No. 1062 de la urb. Villa Paraiso San Roque  de la ciudad de El Alto , el mismo cuenta con construcciones en plantas bajas , se puede evidenciar que parte de las mismas son de vivienda y de un taller de uso comercial ,los materiales de construccion son de ladrillo y adobe portantes , cuenta con con los servicios basicos  y su ubicacion es en avenida de 18 mts.  El  indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. VILLA PARAISO SAN ROQUE DE LA CIUDAD DE EL ALTO.-'),
(478, 'AVA-00478', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF.-', ' Me dirijo a Usted para informarle , que despues de la inspeccion , toma de fotografias , medicion  y los calculos correspondientes  del presente avaluo los resultados son : Inmueble ubicado en la Calle S/N  de la Urb. Copacabana Fonvis de la ciudad de El Alto . el mismo es un lote de terreno  con muros perimetrales de ladrillo, no cuenta con servicios basicos pero el zona  cuenta con alcantarillado publico , agua potable  y energia electrica , su ubicacion es en una calle de 12 mts. El indice de comerciabilidad es bueno en el sector. ', ' AVALUO DE INMUEBLE UBICADO EN LA URB COPACABANA FONVIS DE LA CIUADAD DE EL ALTO. -'),
(479, 'AVA-00479', 'RICARDO SUXO', 'GERENTE GENERAL DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted, para informarle que se realizo la inspeccion al inmueble ubicado en la Ex comunidad Santa Rosa de Limani de la localidad de Viacha, el mismo es un terreno sin muros perimetrales por su extencion, con construcciones economicas de una y dos plantas. El uso de suelos es netamente agricola. Tiene luz y agua. ', 'AVALUO DE INMUEBLE UBICADO EN LA ZONA DE SANTA ROSA DE LIMANI VIACHA.-'),
(480, 'AVA-00480', 'RICARDO SUXO . ', 'GERENTE GENERAL DIACONIA FRIF. -', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes  los resultados del presente avaluo son : Inmueble ubicado en la Avenida Bartolina Sisa No. 3915 de la Urb. San Roque 16 de Agosto de la ciudad de El Alto , el mismo cuenta con construcciones de ladrillo en planta baja en la parte posterior del terreno , cuenta con los servicios basicos y se pudo evidenciar el adoquinamiento de la via y los mejoramientos en servicios en el sector. Su ubicacion es en avenida  de 15 mts. y el indice de comerciabilidada es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO E N LA URB. SAN ROQUE 16 DE AGOSTO DE LA CIUDAD DE EL ALTO.'),
(481, 'AVA-00481', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF.- ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion  y los calculos correspondientes del presente avaluo los resultados son : inmueble ubicado en la Calle s/n  de la Urb. Tarapaca  de la ciudad de El Alto, el mismo cuenta con construcciones de ladrillo en planta baja en obra gruesa , cuenta con los servicios de agua potable y energia electrica, sin embargo la zona tiene todos los servicios basicos. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. TARAPACA DE LA CIUDAD DE EL ALTO. -'),
(482, 'AVA-00482', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF.- ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes del presente avaluo los resultados son :Inmueble ubicado en la Calle Jose Reyes No. 8143 de la Urb.  Villa Ingenio Distrito 2 Unidad 1 de la ciudad de El Alto . El mismo cuenta con una construccion de adobe portante en la parte posterior del predio , su estado de conservacion no es optima. Cuenta con todos los servicios basicos y gas. La zona tiene infrestructura vial urbana en buenas condiciones.  El indice de comerciabilidad es bueno en el sector. ', 'AVALUO  DE INMUEBLE UBICADO EN LA URB. EL INGENIO DITRITO 2  UNIDAD 1 DE LA CIUDAD DE EL ALTO.-'),
(483, 'AVA-00483', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF.- ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes del presente avaluo los resultados  son : Inmueble ubicado en la Av. Zongo No. 1 , esq. Calle 10 de la Urb. cosmos 77 de la ciudad de El alto  . El mismo cuenta con una construccion solida de hormigon armado en cuatro plantas , se puede evidenciar que la misma  se encuentra en obra gruesa en la planta baja , sin embrago las plantas superiores estan con un acabado del 90 por ciento , faltando unicamente puertas y baterias  de baño , cuenta con todos los servicios basicos  ,gas y telefono. La ubicacion es en avenida y esquina. La infrestructura vial urbana es buena en el sector. El indice de comerciabilidada es bueno. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. COSMOS 77 DE LA CIUDAD DE EL ALTO.-'),
(484, 'AVA-00484', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF. -', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias, medicion y los calculos  correspondientes los  resultados del presente Avaluo son : Inmueble  ubicado en la Calle Chuwa No. 2921 de la Urb. Rio Seco Anexo 25 de Julio de la ciudad de El Alto. El mismo cuenta con con una construccion solida de hormigon armado  en la parte frontal del predio , se puede evidenciar que la misma se encuentra con un acabado al 50 porciento, cuenta con todos los servicios basicos y gas , su ubicacion es frente a un equipamiento edil y deportivo . El indice de comerciabilidad es bueno en el Sector.', '  AVALUO DE INMUEBLE UBICADO EN LA URB. RIO SECO ANEXO 25 DE JULIO DE LA CIUDAD DE EL ALTO. '),
(485, 'AVA-00485', 'IDEPRO', 'OFICIAL DE NEGOCIOS.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Av. Vicente Ballivian esq. Av. Rosendo Gutierrez No.3195 de la urbanizacion San Luis II de la ciudad de El Alto, el mismo cuenta con unas construcciones de una planta, varias habitaciones y un bano. Tiene todos los servicioos basicos y gas. La ubicacion del lote es en esquina y sobre dos avenidas.  El indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. SAN LUIS TASA II DE LA CIUDAD DE EL ALTO.- '),
(486, 'AVA-00486', 'RICARDO SUXO. ', 'GERENTE GENRAL DIACONIA FRIF. ', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes del presente Avaluo son : Inmueble ubicado en la calle 1l-21 S/N de la Urb. Mariscal Santa Cruz jurisdiccion de Viacha, el mismo cuenta con una construccion de abobe en obra gruesa, sin muros perimetrales. No cuenta con servicios basicos.   Su ubicacion es frente a un equipamiento mixto. El indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. MARISCAL SANTA CRUZ JURISDICCION DE  VIACHA.-'),
(487, 'AVA-00487', 'RICARDO SUXO . ', 'GERENTE GENERAL DIACONIA FRIF. -', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes del presente Avaluo son : Inmueble ubicado en la Avenida S/N, de la Urb. Tarapaca de la ciudad de El Alto. El mismo cuenta con una construccion pequena de adobe portante en obra gruesa. El inmueble cuenta unicamente con el servicio de agua potable , sin embargo la zona tiene todos los servicios basicos y gas. Su ubicacion es en Avenida de 18 mts. El indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. TARAPACA DE LA CIUDAD DE EL ALTO.-'),
(488, 'AVA-00488', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Av. Periferica S/N de la urbanizacion San Francisco Silva de la ciudad de El Alto, el mismo lote baldio sin muros perimetrales(actualmente se vienen realizando trabajos de instalacion de columnas para los muros).  La ubicacion del lote es sobre una Av. de 60.00ml. de ancho,( actualmente se vienen realizando trabajos de mejoramiento vial). El lote tiene dos ingresos (avenida y calle) El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. SAN FRANCISCO DE SILVA DE LA CIUDAD DE EL ALTO.-'),
(489, 'AVA-00489', 'RICARDO SUXO. ', 'GERENTE DIACONIA FRIF. -', 'Me dirijo a Usted para informarle  que despues  de la inspeccion y toma de fotografias , medicion y los calculos correspondientes del presente avaluo , los resulatdos  son : Inmueble ubicado en la Calle Himnos de Unidad  S/N de la Urb. Tarapaca de la ciudad de El Alto. El mismo  cuenta con una pequena habitacion de ladrillo portante en obra gruesa , cuenta con tres muros perimetrales  y no cuenta con servicios basicos.  Su ubicacion es cercano a Puente Vela, aerea comercial. El indice  de comerciabilidad es bueno en el sector.  ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. TARAPACA  DE LA CIUDAD DE EL ALTO. '),
(490, 'AVA-00490', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle 3 esq. Calle H de la Urb. Barrio Lindo, ladera Oeste de la ciudad de La Paz, el mismo cuenta con pequenas construcciones precarias. Tiene todos los servicios basicos y gas. El ingreso al predio es mediante gradas, por tener una topografia pendiente.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. BARRIO LINDO (CHAMOCO CHICO) CIUDAD DE LA PAZ.-'),
(491, 'AVA-00491', 'RICARDO SUXO . ', 'GERENTE GENERAL DIACONIA FRIF. -', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias ,medicion y los calculos correspondientes  del presente Avaluo los resultados son : Inmueble ubicado en la Calle 12 No.203 de la Urb. Rio Seco Lotes y Servicios de la ciudad de el Alto, el mismo cuenta con una construccion solida de hormigon armado  de cuantro plantas, dos en obra gruesa. Cuenta con todos los servicios basicos y gas, su ubicacion es en Avenida. El indice de comerciabilidad es bueno en el sector. ', '  AVALUO DE INMUEBLE UBICADO EN LA URB. RIO SECO  LOTES Y SERVICIOS DE LA CIUDAD DE EL ALTO. -'),
(492, 'AVA-00492', 'RICARDO SUXO.', 'GERENTE GENERAL DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Av. Esplendit esq. Calle Metropolitana No. 3044 de la Urb. German Busch 1-1-2, de la ciudad de El Alto, el mismo cuenta con construcciones economicas de una y dos plantas. Tiene todos los servicios basicos y gas.  La zona se encuentra mejorandop las vias y equipamientos.  El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. GERMAN BUSCH 1-1-2 DE LA CIUDAD DE EL ALTO. '),
(493, 'AVA-00493', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF. -', 'Me dirijo a Usted para informarle que despues de la inspeccion realizada , toma de fotografias , medicion , y los calculos correspondientes del presente avaluo los resultados son : Inmueble ubicado en la Calle Tacaya  No. 211 Esq. Calle Gustavo Navarro de la ciudad de El Alto . El mismo cuenta con muros perimetrales de ladrillo con diez machones de hormigon armado  y zapatas  para futuras plantas , cuenta con el servicio basico de agua potable  solamente , su ubicacion es en esquina y el indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. EL INGENIO DISTRITO 2 UNIDAD 2 DE LA CIUDAD DE EL ALTO. '),
