(495, 'AVA-00495', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Av. Manuel Pinto esq. Calle II No. 3384 de la Urbanizacion 16 de la ciudad de El Alto, el mismo cuenta con una construccion solida de dos plantas en obra gruesa. Cuenta con todos los servicios basicos y gas. La ubicacion del predio es sobre una Avenida principal. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB.  16  DE NOVIEMBRE DE LA CIUDAD DE EL ALTO.-'),
(496, 'AVA-00496', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente, me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Calle Pedro Nolasco No. 1054, de la Urb. 16 de Febrero de la ciudad de El Alto, el mismo cuenta con una edificacion economica de una planta. Tiene todos los servicios basicos y gas. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. 16 DE FEBRERO DE LA CIUDAD DE EL ALTO.-'),
(497, 'AVA-00497', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se llevo a cabo la inspeccion al inmueble ubicado en la Av. Heroes del Gas esq. Calle Mina Matilde No. 3055 de la urb. San Antonio (San Roque) de la ciudad de El Alto, el mismo cuenta construcciones economicas en dos bloques, una es relativamente nueva y otras antiguas de una y dos plantas. Tiene solamente servicios de agua y luz. La ubicacion del predio en cuestion es en esquina y sobre avenidas. El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. SAN ANTONIO (SAN ROQUE) DE LA CIUDAD DE EL ALTO.-'),
(498, 'AVA-00498', 'FLIA. MALDONADO', 'PROPIETARIO.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la zona de Miraflores, Calle San Salvador esq. Calle Cuba No. 1481, ciudad de La Paz, el mismo cuenta con una construccion solida de tres plantas con todas sus dependencias, un pequeno garzonier con terraza y tiendas comerciales. Cuenta con todos los servicios basicos y otros. La ubicacion del predio en cuestion es muy cercano a la Av. German Busch y el monumento, el sector es comercial. El indice de comerciabilidad es muy bueno. ', 'AVALUO DE INMUEBLE UBICADO EN LA ZONA DE MIRAFLORES DE LA CIUDAD DE LA PAZ.-'),
(499, 'AVA-00499', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF.- ', 'Me dirijo a Usted para informarle que despues de la inspeccion, toma de fotografias ,medicion y los calculos correspondientes del presente Avaluo los resultados son: Inmueble ubicado en la final de la Avenida Mcal. Andres de Santa Cruz No. 1043 de la Urb. El Ingenio Distrito 2 Unidad 2 de la ciudad de El Alto, el mismo cuenta con una construccion solida de dos plantas en obra gruesa ubicado en la parte frontal del lote. Cuenta con los servicios basicos de agua potable y energia electrica , su ubicacion es en avenida de 30 mts.  El indice de comerciabilidad es bueno en el sector. ', '  AVALUO DE INMUEBLE UBICADO EN LA URB. EL INGENIO DISTRITO 2 UNIDAD 2 DE LA CIUDAD DE EL ALTO.-'),
(500, 'AVA-00500', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo aUsted para informarle que se realizo la inspeccion al inmueble ubicado en la Av. Guzman de Rojas esq. Calle Venezuela No.   de la Urb. Tarapaca de la ciudad de El Alto, el mismo cuenta con unas construcciones economicas de una planta. Tiene servicios de luz y agua potable. La ubicacion del predio en cuestion esta cerca a un Coliceo.  El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. TARAPACA DE LA CIUDAD DE EL ALTO.-'),
(501, 'AVA-00501', 'RICARDO SUXO. ', 'GERENTE GENERAL  DIACONIA FRIF.', 'Me dirijo a Usted para informarle que despues de la inspeccion , toma de fotografias , medicion y los calculos correspondientes del presente avaluo los resultados son : Inmueble ubicado en la Calle  Sipreses No. 386 de la Urb . Urkupina Uno de la localidada de Viacha , el inmueble  es un lote de terreno  con  muros perimetrales  de adobe y ladrillo , no cuenta con servicios basicos  y su ubicacion es proximo a la carretera a Viacha, se puede observar  el mejoramiento vial urbano , el indice de comerciabilidad  es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADOE EN LA URB. URKUPINA UNO DE LA JURIDICCION DE LA LOCALIDAD DE VIACHA .'),
(502, 'AVA-00502', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF.-', 'Me dirijo a Usted para informarle que despues de la inspeccion realizada, toma de fotografias , medicion y los calculos correspondientes del presente Avaluo son : Inmueble ubicado en la calle Oman No. 3523 de la urb. Bautista Saavedra  U.V. J de la ciudad de El Alto. El mismo cuenta con una construccion de ladrillo portante en la parte posterior de predio , cuenta con los servicios basicos de agua potable , energia electrica y gas. Se puede evidenciar el mejoramiento vial urbano y de servicios.  El indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA  URB. BAUTISTA SAAVEDRA U.V. J DE LA CIUDAD DE EL ALTO.-'),
