(509, 'AVA-00509', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado sobre la Calle (camino)Capinota S/N de la  Comunidad Quincucirca Canton Laripata de la localidad de Sorata La Paz, el mismo area rural. Los terrenos son tres parcelas no continuas ubicados sobre terreno pendiente, donde se produce frutas y otros. En dos de las parcelas se tienen construcciones sumamente precarias. El sector cuenta con servicios de luz y agua.  RECOMENDACIONES.-Se recomienda al propietarios realizar un levantamiento topografico georeferenciado para determinar con exactitud las colindancias y limite de propiedad con terrenos colindantes.', 'AVALUO DE INMUEBLE UBICADO EN LA LOCALIDAD DE SORATA LA PAZ.-'),
