(514, 'AVA-00514', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la localidad de Palca Sector Wila Pampa, La Paz, los mismo son dos terrenos agricolas, con un acceso accidentado, muy cerca al rio Palca, no cuenta con agua, sin embargo los riegos se realizan con  agua del rio. El sector tiene un clima apto para sembradios. RECOMENDACIONES : Se sugiere se realize un levantamiento topografico para la determinacion de limites con los terrenos colindantes.', 'AVALUO DE INMUEBLE UBICADO EN LA LOCALIDAD DE PALCA SECTOR WILA PAMPA , LA PAZ.-'),
