(543, 'AVA-00543', 'RICARDO SUXO .', 'GERENTE GENERAL DIACONIA FRIF. -', 'Me dirijo a Usted para informarle  que despues de la imspecion realizada , toma de fotografias , medicion y los calculos correspondientes  del presente avaluo son :  Inmueble ubicado en la Calle Heroes de Ayacucho No. 6005 Esq. Calle Magallanes de la Urb. Villa Mariscal sucre Hichusirca Chico  de la ciudad de El Alto, el mismo cuenta con construcciones economicas de ladrillo portante  en planta baja.  Cuenta con los servicios basicos  y gas.  Su ubicacion es en esquina . El indice de comerciabilidad es bueno en el sector.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. VILLA MARISCAL SUCRE HICHUSIRCA CHICO  DE LA CIUDAD DE EL ALTO .-'),
(544, 'AVA-00544', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF. -', 'Me dirijo a Usted para informarle que despues de la inspeccion realizada , toma de fotografias , medicion y los calculos correspondientes del presente avaluo los resulatdos son : Inmueble ubicado en la avenida circunvalacion s/n de la Urb. San Pedro Laja  de la ciudad de El Alto . El mismo tiene murallas perimetrales de ladrillo. No cuenta con servicios basicos, la zona tiene luz y agua potable. La zona se encuentra en proceso de asentamiento pasivo y mejoramiento en servicios.', 'AVALUO DE INMUEBLE UBICADO EN LA URB. SAN PEDRO LAJA DE LA CIUDAD DE EL ALTO.-'),
(545, 'AVA-00545', 'RICARDO SUXO . ', 'GERENTE GENERAL DIACONIA FRIF.-', ' Me dirijo a Usted para informarle que despues dela inspeccion realizada , toma de fotografias , medicion y los calculos del presente avaluo son : Inmueble ubicado en la calle 2 prolongacion No. 10 de la localidad de Desaguadero La Paz, el mismo cuenta con una pequena construccion de ladrillo portante en la parte posterior del predio , tiene muro perimetral de ladrillo con machones de Ho. Ao. mismos que estan considerados. Cuenta con servicios basicos. El lote de terreno tiene una superficie significativa y se ubica detras del estadio. El indice de comerciabilidad es bueno. ', 'AVALUO DE INMUEBLE UBICADO EN LA LOCALIDADA DE DESAGUADERO , LA PAZ. -'),
(546, 'AVA-00546', 'RICARDO SUXO', 'GERENTE DIACONIA FRIF.-', 'Mediante la presente me dirijo a Usted para informarle que se realizo la inspeccion al inmueble ubicado en la Urb. villa Palermo Chasquipampa de la ciudad de La Paz, el mismo cuenta con construcciones de una planta en dos bloques, una en proceso de obra fina con todas sus dependencias. Tiene todos los servicios basicos. Su ubicacion es cercana a la Avenida principal de la zona. El indice de comerciabilidad es bueno.', 'AVALUO DE INMUEBLE UBICADO EN LA CALLE NICOLAS PACHECO No. 12 DE LA  URBANIZACION CHASQUIPAMPA DE LA CIUDAD DE LA PAZ.-'),
(547, 'AVA-00547', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF.-', 'Me dirijo a Usted para informarle que despues de la inspeccion realizada , toma de fotografias , medicion y los calculos del correspondiente avaluo los resultados son : inmueble ubicado en la Avenida Simon Bolivar No. 1020 de la Urb. Los Pinos de la ciudad de El Alto. El mismo cuenta con construcciones de adobe portante  en la parte posterior del predio , su estado de conservacion es regular , La ubicacion es en Avenida de 30.00 mts. Cuenta con todos los servicios basicos y gas. La infrestructura vial urbana se encuentra en proceso de  mejoramiento : El indice de comerciabilidada es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO EN LA URB. LOS PINOS DE LA CIUDAD DE EL ALTO. ');
