(548, 'AVA-00548', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONIA FRIF.- ', 'Me dirijo a Usted para informarle que despues de la inspeccion  , toma de fotografias , medicion y los calculos correspondientes del presente avaluo los resultados son : Inmueble ubicado en la Calle Eduardo Diez de Medina No. 2254 de la Urb. Villa Mercedes U.V. H de la ciudad de El Alto . El mismo cuenta con construcciones  de una y dos plantas , en la parte frontal una construccion solida de una planta en obra gruesa, en la parte posterior del predio  cuenta con una construccion de adobe portante y otra de dos plantas con sus dependencias. Tiene todos los servicios basicos. Cuenta con los servicios basicos. El indice de comerciabilidad es bueno en el sector. ', 'AVALUO DE INMUEBLE UBICADO  EN LA URB. VILLA MERCEDES  U.V. H   DE LA CIUDAD DE EL ALTO .-'),
(549, 'AVA-00549', 'RICARDO SUXO. ', 'GERENTE GENERAL DIACONI AFRIF.-', 'Me dirijo a usted para informarle  que despues de la inspeccion realizada , toma de fotografias , medicion  y los calculos del presente Avaluo son: Inmueble ubicado en la Calle Los Andes No. 2334 de la Urb. La Fortaleza, San Roque de la Ciudad de El Alto . El mismo cuenta con construcciones de una planta de adobes portantes , ademas  de tener una construccion de de hormigon armado y adobes en la parte posterior del predio que se encuetra en obra gruesa. Cuenta con los servicios de agua potable y energia electrica , su ubicacion es en calle de 8.00 mts. y frente a equipamiento . El indice de comercializacion es bueno en el sector. ', 'AVALUO DE INMUEBLE  UBICADO EN LA URB. LA FORTUNA DE LA CIUDAD DE EL ALTO. '),
(550, 'AVA-00550', 'RICARDO SUXO. ', 'GERENTE  DIACONIA FRIF.-', 'Mediante la presente, me dirijo a Usted para in formarle que se realizo la inspeccion al inmueble ubicado en la Calle Camacho S/N, de la Urbanizacion San Luis de San Roque de la ciudad de El Alto, el mismo cuenta con una pequena construccion en obra gruesa de ladrillo. Cuenta con servicios de energia electrica y agua potable.  La zona se encuentra en proceso de mejoramiento en servicios y vias. El indice de comerciabilidad es bueno en el sector.', '  AVALUO DE INMUEBLE  UBICADO EN LA  URB. SAN LUIS DE SAN ROQUE  DE LA CIUDAD DE EL ALTO.-');
